 INSERT INTO `ds_announce` VALUES ('1','IPFS介绍','<p><br/></p><div>
	&nbsp; &nbsp; &nbsp;<span style=\"font-size:18px;\"> &nbsp; 星际文件系统（InterPlanetary File System，缩写ipfs）是一个旨在创建持久且分布式存储和共享文件的网络传输协议。该技术是一种内容可寻址的对等超媒体分发协议。在IPFS网络中的节点将构成一个分布式文件系统。它是一个开放源代码项目，自2014年开始由Protocol Labs在开源社区的帮助下发展。其**初由Juan Benet设计。</span> </div><div><span style=\"font-size:18px;\">&nbsp; &nbsp; &nbsp; &nbsp; IPFS是一个对等的分布式文件系统，它尝试为所有计算设备(ipfs矿机)连接同一个文件系统。在某些方面，IPFS类似于万维网，但它也可以被视作一个独立的BitTorrent群、在同一个Git仓库中交换对象。换种说法，IPFS提供了一个高吞吐量、按内容寻址的块存储模型，及与内容相关超链接。这形成了一个广义的Merkle有向无环图（DAG）。IPFS结合了分布式散列表、鼓励块交换和一个自我认证的命名空间。IPFS没有单点故障，并且节点不需要相互信任。分布式内容传递可以节约带宽，和防止HTTP方案可能遇到的DDoS攻击。</span> </div><div><span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 该文件系统可以通过多种方式访问，包括FUSE与HTTP。将本地文件添加到IPFS文件系统可使其面向全世界可用。文件表示基于其哈希，因此有利于缓存。文件的分发采用一个基于BitTorrent的协议。其他查看内容的用户也有助于将内容提供给网络上的其他人。IPFS有一个称为IPNS的名称服务，它是一个基于PKI的全局命名空间，用于构筑信任链，这与其他NS兼容，并可以映射DNS、.onion、.bit等到IPNS。</span></div><p><span style=\"color:#444444;font-family:-apple-system, BlinkMacSystemFont, \"></span> </p>','admin','1589512147','1591001504','all','7','/Public/Uploads/news/5ebe670708e51.png');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('8','星际元公司简介','<div><span style=\"font-family:NSimSun;font-size:24px;\"><strong>广东星际元科技有限公司</strong></span> </div><p style=\"text-align:center;\"><img width=\"319\" height=\"319\" alt=\"\" src=\"/APP/Modules/Systemlogined/Tpl/Public/kindeditor/attached/image/20200526/20200526113608_72487.jpg\"/><span style=\"font-family:NSimSun;font-size:18px;\"><strong><br/></strong></span> </p><p><span style=\"font-family:NSimSun;font-size:18px;\"><strong>简要介绍</strong></span><br/>星际元致力成为中国领先的区块链技术公司，专注于在全球范围内投资和孵化最前沿、最具价值的区块链项目。主要业务包括区块链股权投资、区块链产业基金、社区社群运营、星际元商学院、矿场托管、区块链Token实体应用等。自成立以来，致力于区块链技术、应用软件开发、分布式存储服务器托管、数据中心运营、IPFS全球生态的建立与发展。</p><p><span style=\"font-family:NSimSun;font-size:18px;\"><strong><br/></strong></span> </p><p><span style=\"font-family:NSimSun;font-size:18px;\"><strong>团队介绍</strong></span><br/>星际元核心团队在区块链技术、商业运营与生态系统建设等方面有着深厚技术积累。核心团队主要由技术极客和资深运营及业务专家组成，包括国内顶尖的区块链核心开发专家，金融机构基金经理，以及互联网金融投行的专业金融人才等。同时，公司与多个IPFS项目头部矿池形成战略合作，团队一直深耕IPFS项目，与IPFS协议实验室直接、深入地技术交流，对IPFS项目有基于生态价值的深刻认知。</p><p><span style=\"font-family:NSimSun;font-size:18px;\"><strong><br/></strong></span> </p><p><span style=\"font-family:NSimSun;font-size:18px;\"><strong>星际元文化与价值</strong></span><br/>1.星际元是一家旨打造所有参与者用户乐于共存的创业平台。星际元是目前全球市场起步门槛最低，仅需2388元就可以体验参与的IPFS项目，从而最大限度地利于最广泛的人群参与和享受整个项目生态的发展红利。参与群体的广泛性即是区块链精神的本质和要义。<br/>2.综观全局，星际元是全市场最具活力和生命力的平台。公司甄选了最优的时间节点，以最小的资金成本和时间成本切入到IPFS项目，同时星际元以TOKEN经济来发展公司，让所有用户都有机会参与到公司的发展和享受公司分红权，从公司架构上践行区块链精神，锻造弱中心化的、利于最广泛人群共谋发展的公平、透明的创业共进平台。<br/>3.星际元发起人具有强有力的资本和资源。公司多位发起人为金融、互联网、品牌运营、资本运作等行业精英，多次创业和连续创业者，其中不乏上市企业、网络科技、通信工程、金融投资等细分行业龙头。<br/>4.星际元公司已着眼布局主网上线后Filecoin时代，将分步推进行业后端规划，与配套合作伙伴启动一、二级资本市场联动，为用户提高投资收益并有效降低风险。借助专业的数字资产基金团队，通过一二级市场的价格联动，用套期保值和套利对冲等方式为用户提高投资收益并有效降低风险。数字货币前100名币种中基金持有多个币种为前50名地址。星际元公司合作的基金是国内较早参与区块链行业和对数字货币认知最深的团队。</p>','admin','1590198427','1591001520','all','0','/Public/Uploads/news/5eccbdfacc13e.jpg');/* MySQLReback Separation */
