 INSERT INTO `ds_announce` VALUES ('9','周五上午九点，官方5月电话会议与你有约！','<div><strong>Filecoin官方将进行第二次Filecoin挖矿社区电话会议</strong> </div><div><br/>会议时间：太平洋标准时间2020年5月28日，星期四，下午6:00 | 9:00 CST |&nbsp;美国东部时间晚上9:00。</div><div><br/><strong>北京时间2020年5月29日，星期五，上午9：00。</strong> </div><div><br/><strong>主要内容：</strong> </div><div>
	1）Testnet Phase 2的概述。</div><div>
