	3）有关Filecoin网络上挖矿的问题。</div><div><br/><strong>参与方法：</strong> </div><div>
	1）在 Filecoin Project Slack上设置一个帐户。</div><div>
	2）通话前5分钟，将在＃fil-mining松弛频道上发布指向通话的链接。</div><p><br/></p>','admin','1590643883','1591001530','all','0','/Public/Uploads/news/5ecf4dd516a78.jpg'),('10','Filecoin官方矿工大会五大要点','<div align=\"center\">
	<img width=\"359\" height=\"620\" alt=\"\" src=\"/APP/Modules/Systemlogined/Tpl/Public/kindeditor/attached/image/20200529/20200529172702_98971.jpg\" />
</div>','admin','1590743800','1590745082','all','0','/Public/Uploads/news/5ed0d40574c7d.png');/* MySQLReback Separation */
