 INSERT INTO `ds_announce` VALUES ('12','IPFSBase独家：Filecoin矿工会议解读','<p style=\"text-align: center;\"><span style=\"font-size: 20px;\"><strong>IPFSBase独家：Filecoin矿工会议解读</strong></span></p><p><strong><span style=\"font-size: 18px;\"><br/></span></strong></p><p style=\"text-indent: 2em;\">2020年5月29日，Filecoin项目官方组织第二次矿工会议，解答了全世界矿工关于项目发展的问题。</p><p style=\"text-indent: 2em;\"><br/></p><p style=\"text-indent: 0em; text-align: center; margin-bottom: 10px;\"><span style=\"font-size: 18px;\">生态发展</span></p><p style=\"text-indent: 2em;\">IPFS节点生态每年都稳步增长，目前已经达到40多万个，散布于世界各地。合作生态项目也趋于多元化，各个细分领域的头部机构纷纷选择IPFS协议。</p><p style=\"text-indent: 2em;\"><br/></p><p style=\"text-indent: 0em; text-align: center;\"><img src=\"/uploads/image/20200601/1591003934678755.png\" title=\"1591003934678755.png\" alt=\"1.png\"/></p><p style=\"text-indent: 2em;\"><br/></p><p style=\"text-indent: 2em;\">截止目前，IPFS每天为世界存储2.5EB的数据，项目方期望更多对人类发展有意义的数据能够被存储和检索。</p><p style=\"text-indent: 2em;\"><br/></p><p style=\"text-indent: 0em; text-align: center; margin-bottom: 10px;\"><span style=\"text-align: center; text-indent: 0em; font-size: 18px;\">NSE算法</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\">矿工们最关心的问题：何时Filecoin项目的算法会改成NSE算法，今天官方也做出了相应回答。</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 0em; text-align: center;\"><span style=\"text-align: center; text-indent: 0em;\"><img src=\"/uploads/image/20200601/1591003954772220.png\" title=\"1591003954772220.png\" alt=\"2.png\"/></span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\">要等到主网上线后才会更改算法，且表示可能在主网上线后很快就会更改。测试网期间维持原算法不变，这个消息让许多头部节点矿工都松了一口气，之前许多社群还在担忧换算法后，测试网的头部节点排名将大换血。殊不知待主网上线后再更改算法，对于购买矿机的用户来说蕴含着一个潜在风险，如果矿机运维商无法优化算法以适应新的挖矿逻辑，很有可能会使得挖矿收益骤减甚至挖不出矿。</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 0em; text-align: center; margin-bottom: 10px;\"><span style=\"text-align: center; text-indent: 0em; font-size: 18px;\">测试网激励</span></p><p style=\"text-align: left; text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\">会议中官方回应了矿工们最在乎的百万FIL激励计划，官方宣布在测试网运行的三周时间内进行激励，要求矿工节点通过封存数据出块来获取奖励，在此激励期间要求矿工节点必须接受存储和检索的请求，不然就无法获得官方奖励。</span></p><p style=\"text-align: left; text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-align: center; text-indent: 0em;\"><span style=\"text-align: center; text-indent: 0em;\"><img src=\"/uploads/image/20200601/1591003977991837.png\" title=\"1591003977991837.png\" alt=\"3.png\"/></span></p><p style=\"text-align: left; text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-align: center; text-indent: 0em; margin-bottom: 10px;\"><span style=\"text-align: center; text-indent: 0em; font-size: 18px;\">网络验证节点&nbsp;</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\">目前主流的存储方式还是中心化的，例如亚马逊和阿里巴巴的云存储，这样的存储模式存在着众多缺点，首先中心化互联网巨头掌握着海量数据的资源，隐私安全性无法得到保障。其次服务器出现单节点故障就会导致大规模数据丢失。最关键的是单节点传输对于带宽要求很高，且传输速度和传输成本高昂。</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\">而分布式存储就能很好的解决上述问题，但如何保证分布式节点的可信任化，达成存储安全共识。项目方引入了验证节点。</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 0em; text-align: center;\"><span style=\"text-align: center; text-indent: 0em;\"><img src=\"/uploads/image/20200601/1591003995544729.png\" title=\"1591003995544729.png\" alt=\"4.png\"/></span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\">对于网络中的存储节点，可以简化为理想型节点、优质节点、合理节点、劣质节点和恶意节点。为了让那些恶意节点作恶受到应有的惩罚，验证节点将会发挥监督作用。</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\">验证节点会在世界各地均匀设置，名誉良好的个人和机构有机会可以申请，验证节点的运营机制将会保证正确验证的收益远大于贿赂。</span></p><p style=\"text-indent: 2em;\"><span style=\"text-align: center; text-indent: 0em;\"><br/></span></p><p style=\"text-indent: 0em; text-align: center;\"><span style=\"text-align: center; text-indent: 0em;\"><img src=\"/uploads/image/20200601/1591004016920643.png\" title=\"1591004016920643.png\" alt=\"5.png\"/></span></p>','admin','1590745491','1591004239','all','0','/Public/Uploads/news/5ed0d9a07a8b2.png');/* MySQLReback Separation */
