 INSERT INTO `ds_announce` VALUES ('14','IPFS凭什么能让全世界投资者疯狂？','<p style=\"margin: 5px 16px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">最近 IPFS更火了。其激励层Filecoin目前正在进行第二阶段测试，预计今年7~8月即可开挖。那IPFS凭啥这么火？</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">IPFS的构想由Juan Benet在2014年5月份提出。Juan Benet的个人经历很传奇，他毕业于斯坦福大学，创办的第一家公司被雅虎收购。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-family: arial,helvetica,sans-serif; font-size: 16px; font-style: normal; font-weight: normal; word-spacing: 0px; display: inline !important; max-width: 100%; box-sizing: border-box !important; orphans: 2; widows: 2; float: none; -webkit-text-stroke-width: 0px; overflow-wrap: break-word !important; background-color: rgb(255, 255, 255);\">2015年，他创建的IPFS在YCombinator孵化竞赛中拿到了巨额的投资，同时成立了协议实验室。</span><br/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">关于Filecoin挖矿这件事，有太多的个人投资人在向我们询问，是否值得？FIL（IPFS的激励代币）是否值得投资？</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">这些问题非常难回答，不同的人站在不同的角度可以得出完全相反的结论。所以，我们不打算直面回答这些问题，而是把问题拆解给大家看，将决定权交给大家。</span></p><section><p><span style=\"font-size: 20px;\">&nbsp;</span></p><p style=\"text-align: center;\"><span style=\"font-size: 20px;\">01<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">项目定位</span></strong></span></p></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">IPFS（Inter Planetary File System），又叫星际文件系统。IPFS在2015年诞生，到2020年，开发时间已有5年了。这5年中，IPFS社区逐渐变得成熟稳定，影响力越来越大。</span><span style=\"margin: 0px; padding: 0px; text-align: justify; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><img title=\"1591411776622954.jpg\" alt=\"微信图片_20200606104911.jpg\" src=\"/uploads/image/20200606/1591411776622954.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">基于IPFS技术开发的应用也不断出现，IPFS直接整合至Brave浏览器中，将 Hadoop 置于IPFS之上进行p2p数据分析，PeerPad利用IPFS构建无服务器、实时的、离线协作式应用等。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">在陆续与微软、美国宇航局（NASA）等知名机构、企业建立合作关系后，IPFS的实际应用价值得到了进一步深化。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">从各种渠道来的信息看，IPFS已经成为一个明星项目，备受众人期待，关于它的质疑信息越来越少，好多厂家在设计、生产专业IPFS矿机，并准备推向市场。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"font-size:18px\"><br/></span></span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both;\"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"font-size:18px\">02</span><strong>应用场景</strong></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">要讲IPFS的应用场景，我需要知道IPFS的功能。我们知道BT下载，就是每个人既是下载端，也是上传方，所以越多的人使用，则下载速度越快。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">IPFS有这个的分布式存储功能，除此之外最重要的一点是，IPFS还适应了区块链的技术，让存储不可篡改、不可删除。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">基于这样的功能特性，我们可以知道，IPFS至少有两个方面的应用场景。调研了IPFS的功能，认为在未来市场应用方向，将应用于CDN（内容分发）和永恒存储两个场景中。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><img title=\"1591411878184856.jpg\" alt=\"微信图片_20200606105108.jpg\" src=\"/uploads/image/20200606/1591411878184856.jpg\"/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">迅雷的星域CDN在春晚的时候已经为小米提供了直播服务，可见IPFS的内容分发模式是相对靠谱，而且商业模式上也有想象力的。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">在游戏、购物网站 、证券、金融保险、ISP、ICP、网上交易、门户网站、大中型公司、网络教学等领域，都非常需要需要快速、稳定、优质的CDN服务。对于这样的场景，IPFS大有可为。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">在永恒存储方面，用户使用IPFS协议创建永不下线的网站。当前的网站建设依赖于中心化服务器，一旦中心化服务器关闭，则网站就无法继续向用户服务了。CDN是典型的应用场景，永恒存储方面的场景值得一试。</span></p><section><p><span style=\"font-size: 20px;\"><br/></span></p><p style=\"text-align: center;\"><span style=\"font-size: 20px;\">03<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">解决痛点（必要性）</span></strong></span><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; font-size: 18px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong></span></p></section><p style=\"text-align: left;\"><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; font-size: 18px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></strong></span></p><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">众所周知, 互联网是建立在HTTP协议上的. HTTP协议是个伟大的发明, 让我们的互联网得以快速发展.但是互联网发展到了今天HTTP逐渐出来了不足.</span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><img title=\"1591411974550036.jpg\" alt=\"微信图片_20200606105233.jpg\" src=\"/uploads/image/20200606/1591411974550036.jpg\"/></span></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">Web文件经常被删除。回想一下是不是经常你收藏的某个页面, 在使用的时候浏览器返回404(无法找到页面), http的页面平均生存周期大约只有100天。</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"></strong></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">Web文件经常被删除(由于存储成本太高), 无法永久保存. IPFS提供了文件的历史版本回溯功能(就像git版本控制工具一样), 可以很容易的查看文件的历史版本, 数据可以得到永久保存。</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"></strong></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">中心化限制了web的成长。我们的现有互联网是一个高度中心化的网络。 互联网是人类的伟大发明, 也是科技创新的加速器。&nbsp;</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"></strong></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">各种管制将对这互联网的功能造成威胁, 例如: 互联网封锁, 管制, 监控等等. 这些都源于互联网的中心化.而分布式的IPFS可以克服这些web的缺点.</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"></strong></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">现在的互联网应用 ，高度依赖互联网主干网 。主干网受制于诸多因素的影响, 战争, 自然灾害, 互联网管制, 中心化服务器宕机等等, 都可能是我们的互联网应用中断服务. IPFS可以极大的降低互联网应用对主干网的依赖。</span></p></section><section><p><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"font-size: 20px;\"><br/></span></strong></p><p style=\"text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"font-size: 20px;\">04<span style=\"margin: 0px; padding: 0px; text-align: justify; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">技术实现&nbsp;</span></strong></span></span></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"text-align: justify; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-family: -apple-system-font,BlinkMacSystemFont,\">IPFS是点对点的超媒体协议，可以让网络更快、更安全、更开放。它是一个面向全球的、点对点的分布式版本文件系统，试图将所有具有相同文件系统的计算设备连接在一起。</span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"text-align: justify; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-family: -apple-system-font,BlinkMacSystemFont,\"></span><img title=\"1591412055839511.jpg\" alt=\"微信图片_20200606105400.jpg\" src=\"/uploads/image/20200606/1591412055839511.jpg\"/></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">来看看IPFS的工作原理：IPFS从根本上改变了用户搜索的方式。我们知道，通过http浏览器搜索文件的时候，首先找到服务器位置，然后使用路径名称在服务器上查找文件，但是通过协议IPFS，用户可以直接搜索内容。</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">这里是怎么实现呢？首先，IPFS网络里的文件，会被赋予一个哈希值，这个哈希值类似于我们的身份证号，他是独一无二的，它是从文件内容中被计算出来的。</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">然后，当用户向IPFS分布式网络询问哈希的时候，它通过使用一个分布式哈希表，可以快速地找到拥有数据的节点，从而检索到该数据。</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong></p></section><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><br/></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">简单来讲，就是以前我们是通过跳转多层网站才能找到一个文件，但是在filecoin上存储的文件，我们只需查询它的哈希值，便能快速找<span style=\"margin: 0px; padding: 0px; max-width: 100%;\">到。</span></span></span></p></section><section><p style=\"text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"font-size: 20px;\"><br/></span></strong></p><p style=\"text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"font-size: 20px;\">05<span style=\"margin: 0px; padding: 0px; text-align: justify; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; font-size: 18px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">社区运营</span></strong></span></span></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">社区角度分析，主要来自项目官方的社交渠道，如电报群、Slack群人数活跃度等，同时也会考察项目在Twitter和facebook的粉丝情况。</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">在GitHub上，“ipfs”的Watch | Star | Fork三指标分别为 923 | 12562 | 726，均值为4737。</span></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></strong></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">总体可看出，IPFS项目代码在github上得到关注与参与度很高，IPFS的开发者社区活跃度高，网上随处可见ipfs的开发和部署文档，显示ipfs的生态发展较好。</span></span></p></section><p><br/></p><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; font-size: 18px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><img title=\"1591412136732127.jpg\" alt=\"微信图片_20200606105519.jpg\" src=\"/uploads/image/20200606/1591412136732127.jpg\"/></span></strong></span></p></section><section><p style=\"text-align: center;\"><span style=\"font-size: 20px;\"><br/></span></p><p style=\"text-align: center;\"><span style=\"font-size: 20px;\">06<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">团队情况</span></strong></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: justify; font-size: 18px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></strong></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">IPFS的团队是Protocol Lab团队，这是一个专门研究、开发和部署下一代网络协议的实验室，开发和研究能力在业界均属一流。</span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">JUAN BENET，IPFS创始人，斯坦福大学博士，Protocol Lab协议实验室负责人。NICOLA GRECO， Protocol Labs 核心成员。MATT ZUMWALT，Protocol Labs 核心成员。</span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;</span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">项目整体十分受资本市场的青睐，阵容豪华：斯坦福大学基金会、YC孵化器、USV创投基金、DCG。这些都是美国投资界的丰碑，后续吸引了红杉资本等大鳄5千万美金参与的风险投资。</span></p><section><p><br/></p><p style=\"text-align: center;\">07<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify; font-size: 18px;\">总结 &nbsp;</span></strong></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">IPFS项目的真实性靠谱，项目进度总体顺利，而且今年也可以挖矿了。背后的团队和投资方实力强大。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">&nbsp;</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">就项目而言，其创新点在于通过经济激励机制，并通过区块链技术来解决http协议的中心化问题。IPFS要做的事情是颠覆当前http所构造的互联网架构格局，这仍然是非常难的事情。</span></p><p style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify; font-size: 18px;\"></span></strong></span><img title=\"1591413444497705.jpg\" alt=\"微信图片_20200606105906.jpg\" src=\"/uploads/image/20200606/1591413444497705.jpg\"/><span style=\"text-align: justify; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-family: -apple-system-font,BlinkMacSystemFont,&quot;Helvetica Neue&quot;,&quot;PingFang SC&quot;,&quot;Hiragino Sans GB&quot;,&quot;Microsoft YaHei UI&quot;,&quot;Microsoft YaHei&quot;,Arial,sans-serif; font-size: 18px; font-style: normal; font-weight: normal; word-spacing: 0px; display: inline !important; orphans: 2; widows: 2; float: none; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">投资的事情，看的是未来的前景和想象力，所以FIL是非常有想象力的币种。</span></p></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span><br/></p></section>','admin','1591411393','1591413475','all','0','/Public/Uploads/news/5edb06d0deaff.jpg');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('16','Filecoin要实现大规模数据的离线传输啦！','<p><span style=\"text-align: left; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-size: 16px;\">这是Filecoin关于项目系列亮点特征的第一篇博文</span><img title=\"1591673878239730.png\" alt=\"微信图片_20200609113539.png\" src=\"/uploads/image/20200609/1591673878239730.png\"/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">Filecoin被设计用来储存世界上最有价值的信息。在全球范围内，我们每天产生2.5万亿字节的数据。虽然大部分数据不需要永久存储，但其中一些数据涵盖了人类在科学、数学、艺术、历史和人文领域创造的最重要信息。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">Filecoin是一个基于<span style=\"color: rgb(84, 141, 212);\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">区块链</span></strong></span>的市场，用于买卖分散的存储。区块链机制提供了安全的存储保证，而加密货币机制创建了一个动态市场。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">正如我们在（经济模型建设）博客文章中所讨论的。有时当你处理大量数据时，通过互联网传输这些文件以保证安全是困难的(昂贵和耗时的)。对于pb级或更大的数据集，最明智的解决方案通常涉及在硬盘上传输数据。Filecoin协议和项目拥有支持所谓离线数据传输的工具和结构。</p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 32, 96);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><br/></span></strong></span></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 32, 96);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">01何时考虑脱机数据传输</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">在决定是否在线或离线传输数据时，需要考虑的两个因素是<strong><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">费用</span></strong>和<strong><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">时间</span></strong><span style=\"color: rgb(84, 141, 212);\">。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">1.费用</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(0, 0, 0);\"><br/></span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; font-size: 20px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(243, 0, 0);\"></span></strong></span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(0, 0, 0);\">把存储程序想象成网络——数据从一个地方移动到另一个地方的高速公路。</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">这种移动会很快变得非常昂贵。想象一个巨大的信息档案，比如一个博物馆或图书馆，希望在分布式web (dweb)上上传、存储和保护它的收藏。为了做到这一点，组织既可以在互联网上传输数据，也可以使用物理设备进行传输。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(84, 141, 212);\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">使用互联网来传输数据，传输成本会很快增加<span style=\"color:#002000\"><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">。</span></span></span></strong></span>在当今的云服务中，传输pb级的数据需要通过多个地区发送数据，这会产生互连费和区域带宽费，如果你选择租用专线或重试的话，还会产生额外的费用。粗略估计一下成本，仅传输2.5pb数据的带宽就需要大约14万美元——如果你要跨地区传输这些数据，成本还会更高。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">这些费用会增加到档案馆、博物馆和其他非盈利企业。现代艺术博物馆的藏品超过90tb，预计到2025年将增长到1.2 pb。英文维基百科包含600多万篇文章和36亿单词。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">欧洲核子研究中心的开放数据门户包括其粒子物理实验的超过1拍字节的数据。伦敦的自然历史博物馆数据门户包括近400万历史标本。国家档案馆的电子记录部门拥有500tb的数据。这些都是极有价值的海量数据。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62);\">然后，</span><span style=\"color: rgb(84, 141, 212);\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">考虑一下硬盘驱动器本身的成本——存储和运输数据的物理介质</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">。</span></span>一个服务器级的8 TB驱动器大约需要200美元。例如，要传输2.5 pb的数据，你需要大约315个硬盘，总计约63,000美元。虽然你可能会有一些额外的单位成本运输，进口费用，和货币兑换-你远远低于成本流的数据在互联网上!</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">2.时间</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(0, 0, 0);\"><br/></span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(243, 0, 0);\"></span></strong></span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; font-size: 16px; color: rgb(0, 0, 0);\">现在，让我们想象一下，国家档案馆想要把它的电子记录转移到另一个服务器上。</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">以100mbps传输500tb的数据需要一年多的时间。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">用硬盘传输相同的数据只需要下载和发送所需的时间——很可能一周之内就能完成!最重要的是，在某些情况下，物理地发送数据更经济、更快捷。</p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><br/></span></strong></span></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">02使用Filecoin进行脱机数据传输</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">在较小的数据传输中，当存储客户端想要与矿商达成协议时，他们会向矿商提出协议，将“X”数据存储为“Y”长度。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(0, 0, 0);\">在挖掘方和客户端协商协议之后，他们开始将数据从客户端传输到挖掘方，通常通过网络传输。</span></strong></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(84, 141, 212);\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">Filecoin的离线数据传输功能允许数据集非常大的用户离线完成数据传输步骤</span></strong></span>(例如，通过将硬盘从客户端发送到存储矿机)，<span style=\"color: rgb(84, 141, 212);\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">并使交易工作按照预期的链式进行</span></strong>。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">它是通过一个标志来实现的，这个标志告诉客户端不要通过网络传输数据。相反，客户端传递一个CID(描述数据的唯一标识符)，挖掘器必须匹配这个CID才能通过交易。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">这为客户节点在如何建立交易方面提供了灵活性——例如，为矿商传递硬盘驱动器上的特定位置，以获取它们可用于生成CID块的数据。</p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><br/></span></strong></span></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">03Filecoin如何支持离线数据传输</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">5月7日，我们启动了<span style=\"color: rgb(84, 141, 212);\"><strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">Filecoin Discover</span></strong></strong></span><strong><span style=\"color: rgb(0, 32, 96);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong></span></strong>项目，该项目旨在激励早期的矿工订购并存储充满有价值的开源数据的硬盘驱动器，作为交换，他们可以获得额外的Filecoin通证。<br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">这是一种帮助种子Filecoin成为人类最重要的数据集的大本营，并使其可访问他人的方式，以增长我们的知识库和形成新的想法。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">矿工可以选择硬盘驱动器，并在Filecoin发现存储中签署保密协议，这是一个pb级的重要公共数据目录(而且还在增长!)然后矿商将以成本价接收驱动器上的数据。作为存储这些数据的交换，矿工们赚取了Filecoin。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">在硬盘商城上线后的24小时内，我们收到了超过<span style=\"color: rgb(84, 141, 212);\"><strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">600</span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong></strong></span>次的订单，凸显了围绕这个项目的激情。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(84, 141, 212);\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">像Filecoin Discover这样的项目，成功编程的关键是降低硬件成本。</span></strong></span>今年4月，Filecoin提出了一个存储设备(类似于AWS Snowball)的提议，以实现更快的离线数据传输。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">这个RFP的目标是构建一个高成本的、冗余且安全的硬盘驱动器解决方案。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(0, 0, 0);\">矿工们可以租用这些设备一段固定的时间，以保持数据传输。客户端可以将数据加载到这些设备上，采集器在接收数据后将数据卸载到自己的服务器上。</span></strong></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">离线交易也可以在Discover程序之外进行。设想一艘潜艇在海上收集太平洋海底生物的pb级信息。当船回到陆地时，通过邮件发送这些硬盘可能比依靠在线数据传输更有意义。在我们致力于web去中心化的过程中，大量数据的物理传输将继续在信息传播中发挥重要作用。展望未来，eb级的数据传输(例如AWS Snowmobile)是传输大量数据的下一步。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">最终，<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">像离线数据传输这样的解决方案将使Filecoin成为存储数据的传统云存储平台的更强大的替代品。</span></strong></span>数据存储对于每个行业的每个企业来说都是一项真正的成本。如果存储成本下降，小企业就可以节省资金——这些钱可以用于招聘或研发。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">这只是Filecoin网络的独特特性如何帮助企业以更高效、更安全、更实惠的方式满足其存储需求的一个例子。在接下来的几周里，我们将推出更多的文章来强调这些功能。我们希望你能加入我们的任务，去中心化存储和改善信息的访问。</p><p>原文链接：https://filecoin.io/blog/offline-data-transfer-for-large-scale-data/</p>','admin','1591673533','1591685572','all','0','/Public/Uploads/news/5edf03b7e3a79.png');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('17','改造世界，物联网为什么需要IPFS/Filecoin？','<p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">物联网(IoT)正在快速增长已不是什么秘密。预计到2023年，将有近300亿台连接的设备，这在地球上每人超过三台。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">另外，随着放置智能传感器来连接全球数十亿个“事物”，几乎每个行业，无论大小，都出现了新的物联网应用。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"font-size:18px\"><br/></span></span></strong></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both;\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"font-size:18px\">01</span></span></strong><span style=\"margin: 0px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong>数据是当今最有价值的资产</strong></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">想象一下，任何行业都能在世界任何地方购买由IoT设备(或设备集合)生成的数据。它可能来自政府机构购买的北海石油钻井平台上的传感器，以创建更好的天气预测模型;</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">也可能来自一家大型航空公司的喷气发动机，供研究人员训练更好的机器学习算法;或者是在迪拜的一个主要办公大楼里，房地产开发商为了在设计新项目时获得竞争优势而购买的空调机组。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">伴随着这些在某些情况下颠覆性行业的新物联网应用，物联网数据市场的曙光也随之而来。数据是当今最有价值的资产。区块链是释放物联网数据价值的一种方式。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">区块链通过减少访问数据的障碍来加速IoT和其他数据交换的成熟度。但是，这样做需要强大的存储骨干才能在整个事务生态系统中捕获、保留、访问和转换数据。数据按顺序存储在通过不间断链链接在一起的块中。<img title=\"1591686758513161.jpg\" alt=\"微信图片_20200609151225.jpg\" src=\"/uploads/image/20200609/1591686758513161.jpg\"/></span></p><section><p><strong><span style=\"font-size: 18px;\"><br/></span></strong></p><p style=\"text-align: center;\"><strong><span style=\"font-size: 18px;\">02</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify;\">物联网数据市场的机会有多大?</span></strong></span></p></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">根据最初的预测，到2020年，启用区块链的IoT数据市场收入可能达到44亿美元。到2020年，通过这些交易所交易的数据的市场价值可能会升至3.6万亿美元——</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">届时，将有超过100万个组织通过其IoT数据资产获利，每天将交易12EB以上的数据，这相当于到每年4.38ZB。这个数字令人印象深刻，相当于美国国会图书馆存储的全部内容的27,000倍。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">在IoT数据市场中，就像在许多商业交易中一样，将有买家、卖方和经纪人从其资产中提取经济价值，这些资产就是物联网数据。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">买家将能够以不同的方式行事，并通过新的物联网应用程序创建新的、颠覆性的商业模式。卖家将创造新的收入来源。行业将被打乱，幸运的是，行业将被重塑。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">物联网数据几乎无处不在。公司可以选择是否保留其数据或通过出售其IoT数据来创建新的收入流。根据Gartner，80%的组织无法通过其IoT数据获利。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">俗话说“一个人的垃圾是另一个人的财富。”看一下未来的自动驾驶汽车，预计它们每天将通过多个传感器捕获2TB的数据。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">随着汽车向共享经济发展，人们拥有汽车的人越来越少，但汽车每天要使用20个小时，因此车上有有价值的数据可以出售给其他行业，例如保险或智慧城市规划。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"margin: 0px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><img title=\"1591686859375191.jpg\" alt=\"微信图片_20200609151406.jpg\" src=\"/uploads/image/20200609/1591686859375191.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">一家计划在100,000平方英尺的建筑物上进行重大资本支出的公司可以从部署在世界其他地方类似结构中的IoT设备购买数据。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">通过这些数据，公司可以在投资这些系统之前准确地预测HVAC成本，照明使用或服务利用率，从而节省新工厂的项目成本。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">在农业中，无人机可以提供实时温度、土壤质量和风力数据。农业或化学公司可以通过数据许可或直接在特定时间段内销售数据流来购买这些数据，并将其用作研发工作的投入。</span></p><section><p><strong><span style=\"font-size: 18px;\"><br/></span></strong></p><p style=\"text-align: center;\"><strong><span style=\"font-size: 18px;\">03</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify;\">存储是物联网数据市场的支柱</span></strong></span></p></section><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"margin: 0px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">区块链是以一种受保护的方式处理非常敏感的数据。但是为了变得有意义，通常需要对数据进行集中化。在全球范围内收集大量数据的情况下，区块链可以帮助训练AI算法，并以安全、可追溯的方式进行训练。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">无论数据是在计算机网络中集中还是分散，存储都起着至关重要的作用。在典型的区块链上，链上可能有大量数据和元数据，或者数据可能不在链上。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">在这两种情况下，进行更改时都需要数据可访问、可追踪和可跟踪。将数据存储在链上或复制所有内容有利于冗余，但需要足够的存储以避免区块链膨胀。</span></p><p><span style=\"font-size:18px\"><img title=\"1591686929846151.jpg\" alt=\"微信图片_20200609151516.jpg\" src=\"/uploads/image/20200609/1591686929846151.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">但是，将数据置于链外可能会造成单点故障，并增加数据丢失的风险。</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">物联网就是创建新的用例，为用户带来真正的价值。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">物联网市场就是要从这些数据中创造价值和新的收入流。区块链有望通过减少访问数据的障碍来加速物联网数据交换的成熟度。但是区块链不能独自做到这一点。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">由于区块链将数据作为交易存储在链中的多个链路上，因此存储必须在每一步都进行优化。</span></p><section><p><strong><span style=\"font-size: 18px;\"><br/></span></strong></p><p style=\"text-align: center;\"><strong><span style=\"font-size: 18px;\">04</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify; font-size: 18px;\">物联网+IPFS,让万物互联成为可能</span></strong></p></section><p><span style=\"font-size:18px\"></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">“如果没有一种新的、成熟的控制我们的数据所有权的方法，就无法想象人类社会会变得更加数字化。”</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">这句话出自Textile联合创始人兼CEO安德鲁•希尔，他认为IPFS的价值巨大，“它（IPFS）是过去十年中最伟大的发明之一，并且已经在无数实际应用示例中证明了其价值。”</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">IPFS是一个伟大的分布式存储技术的先行者，它是一个具有区块链特征的数据系统。IPFS能以此集成为一种容器化的网络应用程序，运行在独立节点上，以Web服务的形式，供大家使用访问。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">随着与IPFS技术的结合，物联网技术的发展不仅降低了基础设施的成本，还提高了带宽的性能，万物互联的时代，将成为可能。<img title=\"1591687036359243.jpg\" alt=\"微信图片_20200609151659.jpg\" src=\"/uploads/image/20200609/1591687036359243.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">目前IPFS应用项目超过数千个，并在快速增长中。到目前为止，已经有超过100亿份文件上传到了IPFS网络，其意义就如同现在已经超过30枚探测器到达过火星，有超过100万辆的电动汽车每年生产出来。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">如果IPFS得到普及，即使每个矿工只存储一点点的内容，但是累计的空间、带宽、可靠性也将远大于现有的互联网能提供的。在这种情况下，以区块链+IPFS为基础的分布式web将有望变成世界上最快、最可靠的超级数据库。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">人类总是不会停止向前，不会停止创新，不会停止发明，自动驾驶、3D仿生技术、IPFS星际文件系统等，都在从内到外影响人类的未来，它们不再是一种单纯的硬件或软件;</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">也不再是单一的科学工程，代表的是人类一直存在的、不断进化的对现实世界的改造和对未来建设的能力。IPFS和Filecoin也一定会在未来为世界的改造贡献力量！</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span><br/></p><p><br/></p>','admin','1591686336','1591694520','all','0','/Public/Uploads/news/5edf3574d2f7c.jpg');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('18','Filecoin测试网奖励计划','<p><span style=\"color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \">经过多年的研究与开发，Filecoin主网启动逐步临近。今天，我们将发布Filecoin测试网的奖励计划，并邀请世界各地的矿工来竞争获取总计</span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \">达400万个Filecoin代币</strong><span style=\"color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \">的全球和区域性奖励。</span></p><p style=\"text-align:center\"><img title=\"1591756652672667.png\" alt=\"微信图片_20200610103426.png\" src=\"/uploads/image/20200610/1591756652672667.png\"/></p><p><span style=\"color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \"></span><br/></p><p style=\"text-align: center;\"><strong><span style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-size: 24px; font-style: normal; word-spacing: 0px; max-width: 100%; box-sizing: border-box !important; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; overflow-wrap: break-word !important; background-color: rgb(255, 255, 255);\">计划结构</span></strong></p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">测试网奖励计划是一项协作比赛，旨在对网络进行压力测试、鼓励全球范围的参与和帮助矿工为运行全球最大的分布式存储网络做准备。比赛的基本结构很简单：三周内，矿工将相互竞争为网络提供尽可能多的存储容量。全球排名前100位的矿工以及各大洲排名前50位的矿工将根据测试期间他们对网络实现的存储量来获得Filecoin奖励。</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">矿工可以通过两种方式获取更多的奖励：</p><ul class=\" list-paddingleft-2\" style=\"list-style-type: square;\"><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">奖励资金池的大小随着网络总存储容量的增加而增加。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">奖励的总资金池严格按照挖矿贡献的比例分配，取决于他们增加的存储容量占网络总存储量的比例。</p></li></ul><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">“区域”指的是六大洲，其中不包括南极洲。我们按照此清单(<a href=\"https://unstats.un.org/unsd/methodology/m49/)来确定一个国家属于哪个洲。名列前茅的矿工们将瓜分以下总奖励池的奖励：\">https://unstats.un.org/unsd/methodology/m49/)来确定一个国家属于哪个洲。名列前茅的矿工们将瓜分以下总奖励池的奖励：</a><img title=\"1591756143389371.png\" alt=\"微信图片_20200610102759.png\" src=\"/uploads/image/20200610/1591756143389371.png\"/></p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \">*注&nbsp;</span><em style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \">每个</em><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \"><em style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\">区域</em></span><em style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \">至少达到1PiB的存储容量才能解锁<img title=\"1591756172783449.png\" alt=\"image.png\" src=\"/uploads/image/20200610/1591756172783449.png\"/></em></p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">举例计算如下：</p><ul class=\" list-paddingleft-2\" style=\"list-style-type: square;\"><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">比赛期间，位于阿根廷的一个矿工将1.5PiB的存储封装到网络上。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">南美洲地区的总存储量有5.0PiB，因此该地区的领先矿工们将瓜分250,000个FIL。该地区排名前50位的矿工持有3.0PiB，其余的则由小型矿工持有。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">全球排行榜上的总存储量为120PiB，其中排名前100位的矿工持有100PiB,小型矿工持有20PiB。每个区域的总存储容量也达到了1PiB，因此全球最大奖励等级（1百万个 FIL）被解锁。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">1.5PiB足以进入全球排行榜前100名。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">这个矿工将从区域排行榜（总共25万个FIL奖励 * 1.5PiB / 3.0PiB）中获得<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">125,000个FIL</strong>并且从全球排行榜（总共1百万个FIL奖励 * 1.5PiB / 100PiB）中获得&nbsp;<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">15,000个FIL</strong>，总计&nbsp;<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">140,000个FIL</strong>&nbsp;。</p></li></ul><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">除了承诺的封装存储容量外，矿工<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">必须还要准备好成功完成TB级的真实存储和检索交易</strong>才能获得奖励。他们还必须展现出<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">执行整个扇区生命周期</strong>的能力——创建承诺容量扇区、升级它们以存储真实数据和最后终止它们。</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">比赛将包含一个矿工可实时查看的全球和区域奖励排名以及各个矿工存储算力、交易成功率和扇区生命周期完成度的实时仪表板。矿工还可以看到排行榜上显示其名字（个人或公司）以及矿工ID。</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.8em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system,system-ui,\"><span style=\"font-size: 24px;\"><strong><span style=\"color: rgb(51, 51, 51);\">规则</span></strong></span></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: square;\"><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">任何获得的奖励都将被写进创世区块中，并<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">在主网启动后的6个月内线性释放。</strong></p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">为了有资格获得奖励，矿工必须在比赛结束前按照提供的说明从仪表板认证矿工ID，并通过AML/KYC审核。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">用于计算存储容量的标准是原始的字节算力。扇区质量和已验证交易不被考虑在奖励计算内。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">对于区域排行榜，矿工的定位归属取决于其挖矿活动的实际物理位置。在多个区域之间挖矿必须有多个矿工。我们要求来自竞争最激烈地区以外的地区的矿工提交证明其挖矿实际位置的文件。<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">假称自己来自其他地理位置将失去获得奖励和进入排行榜的资格。</strong></p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">如果在比赛期间发现威胁到算力表有效性的漏洞或者Filecoin团队发现了其他无法预料的特殊情况，Filecoin团队可能会提前结束比赛。我们仍将给出在截止到发现此类漏洞之前期间应给的奖励，只要奖励数额仍然能够被有效计算出来。如果有团队向Filecoin团队披露其发现了漏洞，则报告该漏洞的团队将有资格获得最高250,000个FIL的奖励，具体取决于该漏洞的严重性和实际意义（由Filecoin团队确定）。</p></li><li><p style=\"margin: 0px; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; font-size: 1em; line-height: 1.8em;\">尽管我们不希望发生这些，但在任何协议实验室或者Filecoin基金会全权酌情决定由于任何有关法律法规而导致无法交付奖励的情况下，奖励可能会重新分配、推迟或者取消。</p></li></ul><p style=\"margin: 0.5em 0px 1em; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.8em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system,system-ui,\"><strong><span style=\"color: rgb(51, 51, 51); font-size: 24px;\">硬件</span></strong></p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">Filecoin将使用<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">SDR复制证明</strong>（非常类似于现在测试网的结构）来进行测试网奖励计划和主网启动。矿工应该了解Filecoin将在启动之后定期升级其证明。</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Filecoin团队不会推荐任何特定的硬件配置</strong>。为了方便起见，以下是我们用于各种类型测试时使用的配置。非常大的可能还会有更高效的配置，我们强烈建议矿工进行测试和试验来找到最佳组合。</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">测试和小型挖矿：https://pcpartpicker.com/user/tperson/saved/H2BskL</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">大型挖矿：https://drive.google.com/file/d/1QNIMUbEMHvj5LHekKGEPR5nCvhdzIp5e/view?usp=sharing</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.8em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-size: 16px; font-style: normal; font-weight: normal; word-spacing: 0px; white-space: normal; min-height: 1em; max-width: none; box-sizing: border-box !important; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; overflow-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 24px; font-family: \">时间</span></strong></p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">比赛将持续三个星期。我们将在确定启动日期后再确定开始的日期，但比赛很可能在<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">7月初</strong>开始。我们强烈建议矿工从现在开始就做好准备。</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">加入测试网开始挖矿</span><br/></p><p style=\"margin: 0.5em 0px 1em; padding: 0px; max-width: none; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 0.544px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 16px; line-height: 1.8em; font-family: -apple-system, system-ui, \">无论您是资深矿工还是新手矿工，测试网奖励计划是增加您Filecoin网络参与度的绝佳机会。点击这里从Lotus文档(https://docs.lotu.sh/) (Filecoin节点和矿工)以及加入Filecoin Slack社区(https://join.slack.com/t/filecoinproject/shared_invite/zt-dj58b7fq-weyaTEvjHoYF_ENkQHR6Ig)来加入挖矿。</p><p style=\"margin: 0.5em 0px 1em; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.8em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system,system-ui,\"><span style=\"color: rgb(51, 51, 51); font-family: \"></span><em style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \"></em><span style=\"color: rgb(51, 51, 51); font-family: -apple-system, system-ui, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: 0.544px; orphans: 2; text-align: center; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); font-size: 24px; font-family: \"></span></span><br/></p>','admin','1591755951','1592203574','all','0','/Public/Uploads/news/5ee0472cd4fe5.png');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('19','Filecoin主网上线临近，分布式挖矿大热，财富机遇还是区块链新坑？','<p style=\"margin: 0.42rem 0px; color: rgba(0, 0, 0, 0.882353); text-transform: none; text-indent: 2em; letter-spacing: normal; font-family: \"><span style=\"font-family: arial,helvetica,sans-serif; font-size: 16px; box-sizing: border-box; touch-action: pan-y;\">在比特币第三次减半完成后，公链行业头号热点的关注度转移到了ETH2.0上。而另一边，矿圈的一大热点则聚焦在了Filecoin这个项目。2020年5月，Filecoin 测试网络上线；6月10日，Filecoin宣布将发布Filecoin测试网的奖励计划，邀请世界各地的矿工来参与运行网络，获取400万个Filecoin代币奖励。</span></p><p style=\"margin: 0.42rem 0px; color: rgba(0, 0, 0, 0.882353); text-transform: none; text-indent: 2em; letter-spacing: normal; font-family: \"><span style=\"font-family: arial,helvetica,sans-serif; font-size: 16px; box-sizing: border-box; touch-action: pan-y;\">那么最近这个重拾热度的Filecoin项目，到底是什么？其背后的IPFS协议具体原理又是什么？二者关系如何？这个早在2018年就启动的挖矿项目，主网上线时间却一直推迟到今年，FIL代币也一直只有期货，曾经还出现了很多冒充或者利用IPFS名义的挖矿骗局，宣称“分布式存储”类的挖矿项目到底靠不靠谱？我们一一来解答。</span></p><p style=\"margin: 0.42rem 0px; text-align: center; color: rgba(0, 0, 0, 0.882353); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"><span style=\"font-size: 24px;\"><strong style=\"touch-action: pan-y; box-sizing: border-box;\"><br/></strong></span></p><p style=\"margin: 0.42rem 0px; text-align: center; color: rgba(0, 0, 0, 0.882353); text-transform: none; text-indent: 0px; letter-spacing: normal;\"><span style=\"font-size: 24px;\"><strong style=\"touch-action: pan-y; box-sizing: border-box;\">IPFS和Filecoin是何关系？</strong></span><br/></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">Filecoin 是一个基于&nbsp;IPFS协议的去中心化存储网络，也是一个结合了区块链技术的公链系统，FIL（filecoin）是该项目通过1CO发行的基于其公链上的通证代币，用于激励参与&nbsp;Filecoin 网络中存储及检索市场等参与者的行为。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">IPFS，全称 InterPlanetary File System，中文名为“星际文件系统”，它是一个开放的点对点的分布式的文件系统，能将所有具有相同文件系统的计算设备连接在一起。简单点说，任何人都可以免费使用这个协议，基于协议去创建不同类型的应用。通过这个底层协议，可以让存储在IPFS系统上的文件，在全世界任何一个地方快速获取。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">我们现在所使用的互联网协议是“超文本传输协议（HTTP）”，HTTP协议具有超中心化的特性。举个例子，我们从互联网上下载文件或者是浏览网页时，一次只能从一个数据中心获取我们所需要的资料。如果这个数据中心出现故障，或者被攻击，就会出现文件丢失或者网页无法打开的问题。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">而IPFS协议研发的初衷就是对HTTP协议进行补充，解决其存在的中心化的问题。因此，IPFS协议本身是一个去中心化的网络基础设施，它的原理就是利用基于内容的地址来替代基于域名的地址，简单来说，用户寻找的是存储在某地方的内容，而不是某地址，就只需确认验证内容的哈希，这样就能过获得速度更快、安全、健壮、持久的网页。</span></p><p style=\"text-align: left; text-indent: 2em;\"><span style=\"text-align: left; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; box-sizing: border-box; orphans: 2; touch-action: pan-y; -webkit-text-stroke-width: 0px;\"><span style=\"text-align: left; color: rgba(0, 0, 0, 0.882353); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: sans-serif; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; word-spacing: 0px; white-space: pre-wrap; touch-action: pan-y; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">而Filecoin和IPFS两者的关系，从项目上来说，两者是协议实验室</span><span style=\"text-align: left; color: rgba(0, 0, 0, 0.882353); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: sans-serif; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; word-spacing: 0px; white-space: pre-wrap; touch-action: pan-y; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">（Protocol Lab）</span><span style=\"text-align: left; color: rgba(0, 0, 0, 0.882353); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: sans-serif; font-style: normal; font-variant: normal; font-weight: normal; text-decoration: none; word-spacing: 0px; white-space: pre-wrap; touch-action: pan-y; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">推出的两个独立的且有密切联系的项目，filecoin结合了IPFS的特性和区块链技术，是基于IPFS的一个应用；从本质上来说，一个是激励系统，一个是底层协议，Filecoin是IPFS网络的激励层，激励机制就是利用FIL代币。</span></span></p><h2 style=\"text-align: center; color: rgba(0, 0, 0, 0.882353); text-transform: none; line-height: 0.74rem; text-indent: 0px; letter-spacing: normal; font-family: \"><span style=\"font-size: 24px;\"><strong style=\"touch-action: pan-y; box-sizing: border-box;\">Filecoin的运作模式</strong></span></h2><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">讲到这里，可能我们对Filecoin项目具体做什么事情还是有点模糊，简单通俗地说，Filecoin项目想做的事情就是把所有闲置的存储资源利用起来，并形成一个算法市场。举个例子，这种共享资源的模式可以和Airbnb的模式，把闲置的资源放到网络上给需要的人，共享资源的人可以赚得租金。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">在Filecoin中，用户基于需求支付代币雇佣矿工来存储和分发数据，矿工通过贡献闲置的存储空间和带宽并获得代币奖励，因此它是一个由矿工和客户共同参与、各取所需的网络，那么接下来具体分析一下它的运作模式，即经济模型。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">Filecoin作为一个存储网络，它致力于把云存储变成一个存储交易市场，这个交易市场分为“检索市场”和“存储市场”，</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">两个市场中分别存在客户及矿工。存储市场是一个可验证的市场，由区块链网络来进行验证。存储市场中客户提出存储数据的需求，而存储的供给方为存储矿工，提供他们的存储空间。而检索市场为链下市场，提供客户检索所需要的数据，并且由检索矿工来提供检索服务。检索矿工不参与区块生成环节，直接从客户端获取相应服务费用。</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">而FIL代币在其中的目的是对IPFS用户和Filecoin矿工起到一个连接作用。</span></p><p style=\"text-indent: 0em;\"><strong style=\"touch-action: pan-y; box-sizing: border-box;\">1、共识和激励机制</strong></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">Filecoin 采用的是一种混合共识机制 : 以预期共识&nbsp;(EC)&nbsp;为主，复制证明(PoRep)&nbsp;及时空证明(PoSt)&nbsp;为辅。作为激励，Filecoin采用区块链通证体系发行了FIL代币，发行总量20亿枚。按照官方代币分配方案，其中70%将</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">通过区块奖励的方式线性释放，分配给矿工。其余的部分分别按15%、10%、5%分配给团队、投资人和基金会作为研发运营、投资分红、社区建设费用。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">Filecoin的矿工根据其存储能力大小将获得区块奖励，存储能力的衡量方式即矿工在 Filecoin 网络中提供多少单位有效存储空间及能够存储的时长。因此可以理解为，Filecoin矿工的存储能力相当于比特币网络中矿工的算力。矿工获得的区块奖励取决于其存储能力占全网存储能力的比例。例如，一个矿工在网络大小为 100 PB 的情况下提供了 1 PB 的存储算力，那其将获得相应时间内区块奖励的百分之一。</span></p><p style=\"text-indent: 0em;\"><strong style=\"touch-action: pan-y; box-sizing: border-box;\">2、质押机制</strong></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">此外，需要注意的是Filecoin的参与和挖矿并不是有矿机就可以，还需要质押代币。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">Filecoin为了防止客户的数据丢失，设置了一种质押机制，也可以理解为矿工惩罚机制。当一笔交易协议生成时，矿工会将客户提供的数据存放于网络中，这个区域称为扇区</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">&nbsp;(Sector)</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">。每个扇区会包含存储文件内容及承诺存储时长，确保客户在约定存储时长中，可以自由运用自身存储的数据。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">当矿工想添加一个扇区至 Filecoin 网络时，他需要质押一笔锁定资金。这个锁定资金由两个部分组成：矿工自身持有的 FIL 代币以及部分区块奖励。如果矿工在承诺的存储时长内离线，他就会损失一部分的锁定资金。如果矿工完全停止存储行为，那他则可能将失去所有锁定代币。</span></p><h2 style=\"text-align: center; color: rgba(0, 0, 0, 0.882353); text-transform: none; line-height: 0.74rem; text-indent: 0px; letter-spacing: normal; font-family: \"><span style=\"font-size: 24px;\"><strong style=\"touch-action: pan-y; box-sizing: border-box;\"><br/></strong></span></h2><h2 style=\"text-align: center; color: rgba(0, 0, 0, 0.882353); text-transform: none; line-height: 0.74rem; text-indent: 0px; letter-spacing: normal; font-family: \"><span style=\"font-size: 24px;\"><strong style=\"touch-action: pan-y; box-sizing: border-box;\">IPFS挖矿到底靠不靠谱？</strong></span></h2><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">最后，回到Filecoin挖矿这个问题，也是很多矿圈投资者最关心的问题。分布式存储挖矿到底靠不靠谱？</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">2018年，IPFS协议和Filecoin曾风靡矿圈，引起过一阵狂热的挖矿潮，各种“IPFS矿机”遍地开花。由于Filecoin主网上线一再推迟，挖矿的算法迟迟未公布，矿机和代币也一直只有期货，并不能真正地挖矿，对其项目进行模仿和冒充的门槛极低，市场投资者也难辨真假，因此当时曾出现过许多IPFS挖矿骗局，不少投资者深受其害。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">如今，Filecoin项目的进展终于步入正轨，测试网已上线，根据Filecoin最新的线路图，Filecoin主网预计将于7月20日至8月10日之间启动。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">在项目备受关注的背后，我们聚焦到一个问题，Filecoin挖矿到底值不值得参与呢？Filecoin主网上线后，普通人是否可以在家里利用自己的存储设备参与Filecoin挖矿呢？</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">飞尔科CEO</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">（Filecoin.cn中文社区发起人）</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">谢锦斌</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">（人称“谢大炮”）</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">在最近猎云财经的访谈中对此问题发表了看法，</span><strong style=\"touch-action: pan-y; box-sizing: border-box;\">他表示，Filecoin挖矿跟传统的比特币挖矿完全是两个赛道，以传统的比特币挖矿思维来做Filecoin，很容易损失惨重</strong><span style=\"touch-action: pan-y; box-sizing: border-box;\">。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">“Filecoin挖矿与比特币挖矿差异很大。首当其冲的一点是抵押币，而传统比特币挖矿不需要抵押，机器一开就能挖，Filecoin挖矿前提是手上有抵押币，质押你的存储空间。它有三种收益，一个是质押空间，第二种是去存一些随机数，无效数据也能拿到一部分收益，还有一点是存官方提供的可信可验证的数据，这样的话你的收益会更多。”</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">5月28日，江卓尔也曾发微博对近期大热的Filecoin作出评价，他认为目前Filecoin的性能不足以存储小电影，且经济模型错误，当前矿工靠部分GPU计算、而不是靠存储来获得奖励，因此没有任何参与Filecoin挖矿的计划。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">如此看来，对于散户来说，Filecoin挖矿与传统PoW挖矿不同，是一个比较复杂的过程。参与Filecoin挖矿前需要谨慎思考，学习清楚其中的门道，不要跟风入场。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">现在正是项目大热的时候，各种营销乱象丛生，投资者要擦亮眼睛。比如，在前段时间Filecoin测试网公测阶段，各大矿商掀起了刷榜大潮，使出各种营销噱头、堆砌漂亮的测试数据来争夺排位。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">那么，对于已经打算且准备好参与Filecoin挖矿的普通人，在矿机选择上应该需要注意什么？点存科技CEO李浩天认为，最关键的一点就是要选择靠谱的厂家，靠谱的公司，多看、多比较，要看硬件的投入产出比。测试网的数据不代表真实交付的方案，在下单之前，一定要进行实测，测试这些机器的真实性能。此外，要选择那些使用一手硬件，并且可以把硬件交付给你的公司，这个很关键。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">至于Filecoin接下来的主网能否按时顺利上线，犹未可知。毕竟此前项目进度和测试网上线时间多次延期，引起了投资者的不满。考虑疫情的原因，许多投资者依然担心项目会再次延期。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">最后，视角转移到IPFS协议，也就是所谓的分布式存储，它确实是一个值得关注的“发明”。曹寅在接受OKEx情报局的采访中表示，IPFS对整个加密货币生态是个非常重要的基础设施，有可能会替代现在的像百度网盘这样的ToC的公有云，但不适合ToB，比如像金融机构、大型的互联网公司。不过对于普通用户来说的话就已经足够（用）了，光是这一点就会使得下一代的基于区块链互联网上的应用</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">（Web3.0）</span><span style=\"touch-action: pan-y; box-sizing: border-box;\">有了一个非常重要的储存基础。</span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\"><br/></span></p><p style=\"text-indent: 2em;\"><span style=\"touch-action: pan-y; box-sizing: border-box;\">当下，就IPFS的货币经济学来说，仍然存在很多问题，但大家依然寄予非常大的希望。而且就算是IPFS失败了，仍然会有很多类似项目会发展起来，所以我个人觉得这个方向值得关注。不过大家如果真的看好某个赛道的话，建议可以多选几个代币，组成一揽子资产，不要把鸡蛋放在一个篮子里。</span></p><p><br/></p>','admin','1591845607','1592017236','all','0','/Public/Uploads/news/5ee1a5fb7e887.jpg');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('20','Filecoin公布 | 可信配置环节更新','<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(255, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">免责声明:</span></strong></span>将技术概念从一种语言完美地翻译到另一种语言是困难的，因此请注意，<span style=\"color: rgb(255, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">我们不能保证这个翻译的准确性。</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(24, 116, 246);\"></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(24, 116, 246);\">原文链接：https://filecoin.io/blog/trusted-setup-update/</span><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">去年年底，我们成功地完成了可信配置的第一阶段，也就是<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">“powers of tau”</span></strong></span>。自年底以来，我们的团队一直在为可信配置的第二阶段做准备。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">想要了解更多关于第二阶段的信息以及您可以帮助我们做出哪些贡献，请继续阅读！</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><br/></span></strong></span></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">第一阶段回顾</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">简单提醒一下，可信配置环节分为两个阶段进行。第一阶段，也被称为<span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); max-width: 100%;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">“powers of tau”</span></strong></span>环节，适用于给定大小以下的所有<span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); max-width: 100%;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">Groth16 zk-SNARKs</span></strong></span>。在我们的环节里，我们生成了BLS 381曲线上高达<span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); max-width: 100%;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">1亿</span></strong></span>大小的逻辑线路——目前BLS 381曲线上最大的线路！</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \">在大约两个月的时间里来自世界各地的参与者贡献了自己的资源，参与生成安全参数以及以供所有人验证的公共证明，特别感谢参加第一阶段的个人和团队，没有您的支持我们无法进入下一个阶段。</p><p><br/></p><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">第二阶段</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \">随着临近主网启动，我们团队一直在为可信配置的下一阶段做准备。与第一阶段不同，第二阶段生成特定线路的参数。<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">这意味着在第二阶段中，时空证明(PoST)和复制证明(PoReP)的参数都将特定于将要确定下来的的哈希算法、结构和扇区大小。</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \">这也意味着当我们将来对证明结构进行更新时，我们还需进行一次可信配置的第二阶段以生成新的安全参数集来与我们升级后的证明一起使用。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \">对于我们的线路，我们将使用一种相对较新的哈希算法<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">Poseidon</span></strong></span>，该算法可以大大减少我们需要对线路所做的约束。此外，我们将使用Poseidon为<strong>32GB</strong>和<strong>64GB</strong>扇区的以下算法生成参数：*<span style=\"color: rgb(84, 141, 212);\">&nbsp;<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">SDR PoRep * Windowed PoST * Winning PoST</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; font-size: 20px; color: rgb(24, 116, 246);\"><br/></span></strong></span></strong></span></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(62, 62, 62); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">我想成为志愿者。我需要做什么？</span></strong></span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \">通过注册，您可以将您的详细信息添加到Filecoin团队在可信配置环节第二阶段之前可能联系的志愿者列表。鉴于环节的各种要求和各阶段的窗口期，也有可能一部分志愿者没有被我们联系加入。我们将在<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">6月29日起开放第二阶段可信配置环节的社区参与。</span></strong></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \">与我们第一阶段的流程类似，Filecoin团队将发出一个链接来安排参与环节的日程。在您的测试窗口期之前，您会收到有关需要下载的软件的详细说明以及进行环节的逐步说明。在实际的环节中，参与环节涉及下载多个文件、运行程序（将会提供说明）以及为下一个参与者上传输出。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \">如果您希望与下一个阶段的流程保持同步更新，您可以加入Slack上的<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">#fil-trustedsetup</span></strong></span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(255, 129, 36);\">&nbsp;</span>频道 ——我们将在那与参与者进行协调。</p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(62, 62, 62); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><strong><span style=\"color: rgb(0, 0, 0); font-size: 20px;\">参与需要多长时间？我需要什么样的计算机？</span></strong></p><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; white-space: normal;\">以下概述了环节第二阶段的部分内容以及所需的时间：*<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">&nbsp;首先，您将下载环节中前一个参与者的输出文件（约60GB）。</span></strong></span><span class=\"Apple-converted-space\">&nbsp;</span>* 接下来，您需要将数据在指定的软件上运行。请注意，计算时间是取决于您计算机的规格。<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">我们下面的样本计算时间和规格仅供参考</span></strong></span></p></section><p><img title=\"1591933708272208.png\" alt=\"image.png\" src=\"/uploads/image/20200612/1591933708272208.png\"/></p><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">▶最后，您需要上传处理后的数据<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">（约40GB）</span></strong></span><span style=\"color: rgb(84, 141, 212);\">。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">▶我们这边的验证节点将会检查您提交的内容是否有效并确保下一位参与者可以从经过您验证的贡献开始。还有其他问题？欢迎随时通过聊天室或者通过发送电子邮件至<span style=\"color: rgb(84, 141, 212);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">trustedsetup@protocol.ai</span></strong></span>与我们取得联系。<br/></p></section><p><br/></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(62, 62, 62); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(24, 116, 246); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong></span><br/></p><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; font-size: 20px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong></span><br/></p>','admin','1591932121','1592017424','all','0','/Public/Uploads/news/5ee2f8b1590bb.png');/* MySQLReback Separation */
