 INSERT INTO `ds_announce` VALUES ('21','Filecoin获多个顶级交易所力挺，成就数字货币王者地位！','<section><section><section><section><section><section><h1 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">交易所也青睐的Filecoin</strong></span></h1></section></section></section></section></section></section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Filecoin主网虽未上线，但Filecoin的期货却早在2017就已上线。近期，随着二阶段测试网的稳步推进及主网上线时间临近，激发了Filecoin期货价的一波小行情。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">除了Filecoin期货客观的涨势外，临近上线交易所也在暗自布局。今天，先东科技来带大家盘点下主网上线后有哪些交易所将支持FIL交易，又有哪些交易所已上线了FIL的期货。</span></p><p style=\"text-align: center;\"><img title=\"1592185328716108.jpg\" alt=\"微信图片_20200615094020.jpg\" src=\"/uploads/image/20200615/1592185328716108.jpg\"/></p><section><section><section><section><section><h1 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify;\">Coinbase</span></strong></span></h1></section></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Coinbase是第一家宣布支持FIL的顶级交易所。它持有只有少数公司拥有的纽约虚拟货币许可证（BitLicense），并且还符合KYC和AML的规定。</span></section></section></section></section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">2019年9月20日，Coinbase宣布对一系列新数字货币提供上市支持，Filecoin包含其中。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">2020年2月20日，Coinbase入选福布斯区块链50强榜单。2020年4月29日，Coinbase旗下子产品Custody官宣支持FIL交易、托管一条龙服务，Filecoin第一交易所果然不是“盖”的。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><img title=\"1592185379318581.jpg\" alt=\"微信图片_20200615094034.jpg\" src=\"/uploads/image/20200615/1592185379318581.jpg\"/></span></p><section><section><section><section><section><h1 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify;\">Gemini</span></strong></span></h1></section></section><section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Gemini是美国主流加密货币交易所，以采取保守、监管意识强的方法列出新资产而闻名。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">也是世界上第一个完成严格的SOC 2 Type 1检验和2检验的加密货币交易所和受托人。Gemini采取保守策略的交易所上市一个尚未上线的新的加密资产，间接说明了Filecoin的价值。</span></p></section></section></section></section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Gemini2016年成功获得由纽约金融服务局NYSDF颁发的全球首张数字货币交易所牌照，也是首个推出期货合约的交易所。2019年，Gemini荣获《2019年市场选择奖》“最佳加密货币交易所”。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">2020年2月25日，Gemin宣布将为Filecoin提供托管服务，当主网启动时，可以直接在您的Gemini托管帐户中开始接收代币。除了托管服务，Gemini还与纽约州金融服务部（NYSDFS）紧密合作，以获得批准为我们的客户提供Filecoin交易。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><img title=\"1592185416178123.jpg\" alt=\"微信图片_20200615094039.jpg\" src=\"/uploads/image/20200615/1592185416178123.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">接下来，就是已经上线Filecoin期货的交易所盘点：</span></strong></span></p><h3 style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\">gate.io<br/></span></strong></h3><section><section><section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">gate.io 大门国际站创立于2013年，国内比较靠谱的交易所之一。创办至今，已为来自全球超过130个国家的数百万用户，提供了近百种优质区块链资产品类的交易和投资服务。</span></p></section></section></section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">它拥有超级防卫SSL链接，离线比特币钱包技术，即时区块链资产存取功能，多币种地址共享技术，多重安全验证保护，同时提供较低的区块链资产交易费用和提取费用。目前已经有FIL6可以购买。</span></p><h3 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify;\">Lbank.info</span></strong></span></h3><section><section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Lbank.info于2016年上线，致力于以用户为核心，以社区共识为导向，将权利归于社区，将责任托付于节点。目前在Lbank中，有FIL36出售，这是公募中的FIL期货，需要36个月才能解锁。</span><br/></section></section></section><section><section><section><section></section><h3 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">WBF</strong></span></h3></section><section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">纽约WBF Group于2017年注册于纽约，2019年1月注册于新加坡，旗下WBF（中文名为瓦特）是一家全球化的数字资产金融服务平台。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">并在纽约、伦敦、新加坡、胡志明市、首尔、东京等13个城市设有分支机构。拥有覆盖全球4000余家的媒体资源，致力于在全行业持续打造超强“流量帝国”。目前在WBF中已经有FIL6可以购买。</span><br/></p></section></section></section><section><section><section><section><section><section><section><section></section><section></section><section></section></section><section><h3 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">币安</strong></span></h3></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">币安，这家世界顶尖交易所现在暂时还没有成为Filecoin交易所，但一直都有关注IPFS和Filecoin的动态，且在2019年12月5日发推特介绍IPFS底层协议。</span></section></section></section></section></section></section></section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">这样来看，如果Filecoin一切顺利，币安成为Filecoin交易所也是指日可待。&nbsp;除此以外，还有TOP.ONE、Hotcoin Global玩客家、Hotbit等交易所也陆续上线了Filecoin期货。</span></p><p style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><img title=\"1592186082482042.jpg\" alt=\"微信图片_20200615094044.jpg\" src=\"/uploads/image/20200615/1592186082482042.jpg\"/></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Filecoin还未正式上线已受到各大交易所青睐，这并不是偶然事件。我们仔细回望这两年的IPFS发展路径，不难发现Filcoin即将大火的蛛丝马迹：</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">1）IPFS和以太坊合作，已经成为很多DAPP的基础底层，就比如第79期周报内提到的Audius，世界上第一款去中心化的流媒体平台，就是用IPFS技术构建的。</span></p><section><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">其它的应用，Detube（视频）、openbazza（电商）、Brave（浏览器）等等，现在都已经出现，一旦发展成熟，取代现在的中心化应用也是必然。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">2）Filecoin，尽管今年的上线时间受到疫情影响延后到7月底，但我们还是能够看到这个项目在一点一点前进——目前，已经开始最后功能的建设；</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">比如货币的经济结构、互操作网络的实现。有条不紊的同时还能够开发并向网络中注入更多功能，实现高度去中心与安全。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">可以说，尽管团队很低调，但在实力上高调的不行。故此后续Filecoin上线，网络的安全、应用，也当然能达到我们的预期——成为WEB3.0的基础。</span></p><p><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">可以预见的是，国内几家头部交易所一定在密切关注Filecoin项目的动态。毕竟，共识这么强又自带流量的项目，错过，极有可能成为遗憾。未来，Filecoin很可能引领数字货币走向新高度。</span><br/></p></section><p><br/></p>','admin','1592185287','1592186667','all','0','/Public/Uploads/news/5ee6d1fa146a5.jpg');/* MySQLReback Separation */
