 INSERT INTO `ds_announce` VALUES ('22','Filecoin网络节点特点和专业化运维介绍','<p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">大家好，今天我给大家分享的内容有两个：<strong>一个是我们filecoin网络的介绍和优点，另一个是专业化运维特点。</strong></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">首先，我想先分享的是我们filecoin集群网络是怎么样的，又是如何和主网相连的，又有什么优点。</span><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我们Filecoin网络有三个，一是对外的公网，二是对内的内网，三是别家公司没有的智能管理网络。</span></strong></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Filecoin集群网络有很多的设备，包括计算服务器、验证服务器、存储服务器、GPU服务器等等。</span></strong></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">对内的内网</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">使用的是万兆的汇聚层互联，实现内部通信。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">智能管理网络</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">则是在万兆汇聚层外通过交换机连接到我们自己的主机进行监控，将来数据结算也是在智能管理网络上结算。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">接下来我重点讲解我们<strong>对外的公网</strong>。这些机器也是先通过千兆的汇聚层汇聚然后在连接到核心交换机上，在通过路由器到达网关然后连接网络运营商的骨干网。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><img title=\"1592290428244943.jpg\" alt=\"微信图片_20200616145148.jpg\" src=\"/uploads/image/20200616/1592290428244943.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">但是filecoin网络不仅仅是中国的项目，它是全球的，所以肯定要与全球的互联网进行互联。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">目前来说有两个方法，第一个是通过卫星网络。</span></strong></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">比如说到达运营商的骨干网之后再通过骨干网到达卫星公司的卫星地面站，由地面站发送数据到卫星，卫星再转发到别的国家的地面站再连入别的国家的互联网。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">但是这个方法应该是很少使用的，一是因为通信卫星建设费用很高又不方便维修所以使用卫星资源会很贵，另一个是使用卫星通信的话延时很大，因为最近的静止轨道卫星都在3.6万公里的高空，一来一回会很费时间，第三是带宽问题，卫星的转发器资源有限，不能像地面网络带宽那么高。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第二种方法是</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><strong>通过海底光缆的形式</strong>。就是我们的数据到达骨干网之后再通过关口站然后通过海底光缆与全球的互联网连接。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">但是，我国对网络的监控非常严格，</span><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">中国大陆只有4个城市关口站，一是青岛、二是上海、三是汕头、四是香港。</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">目前只有这四个城市有海底光缆与外界相连，其中汕头和香港的海底光缆总量占内地光缆的60%以上。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><img title=\"1592290659825718.jpg\" alt=\"微信图片_20200616145127.jpg\" src=\"/uploads/image/20200616/1592290659825718.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">接下来我来总结下我们filecoin网络节点的优点：<strong>第一个是地理位置优越，我们机房位于东莞的华南数据中心。</strong>我们知道filecoin存储的特点是就近存储就近提取。东莞位于深圳和广州两个一线城市之间，如果这边想要存储数据肯定优先往东莞存储，这是国内的情况。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">国外的话我上面也讲过汕头和香港的海底光缆占据的60%，无论是从汕头还是从香港都会经过深圳、东莞。所以国外的人想往国内存储也好、检索数据也好我们东莞机房的位置都是很好的。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第二个是延时，国内来说我们使用的是骨干网，速度很快，不必担心。</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">而国外的用户想往我们这存储我们机房离汕头和香港都很近，延时很低。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">最后一个是带宽，我们filecoin网络使用的是运营商的企业级千兆带宽。</span></strong></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">什么是企业带宽呢？</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我们都知道家庭的带宽都是共享的带宽，而企业带宽是独享的带宽。许诺的多少就能用多少。可能大家对带宽不太敏感，那我给大家用我们存储的单位算一算吧。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">1000M带宽的单位是Mbps，兆比特每秒，处于8就换成我们存储单位就是125MB每秒，就是每秒钟最大能传输125M大小的文件，而1024M等于1G；</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">也就是大概就是9秒钟就能传输1个G的文件，而1个T又是1024G，也就是大概9000秒，也就是15分钟一个T，那么一天大概一天能传输96个T的文件。当我们主网上线的时候，硬盘的数据就能很快的存满了。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">二是专业化的运维介绍。专业运维是什么呢？为什么要专业运维呢？</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我先讲为什么要专业的运维。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">因为在一个公用的网络里面无论是大还是小，运维就是怎么保证高效率的机器运转，这是第一个高效率，第二个是怎么保证网络集群对外服务的高性能和易用性，最后一个是怎么保证网络的安全性。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><img title=\"1592290710877647.jpg\" alt=\"微信图片_20200616145138.jpg\" src=\"/uploads/image/20200616/1592290710877647.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我们都知道我们的机器放在华南的数据中心，国家级5A数据中心，专业的IDC机房，我们都知道专业的IDC机房是不能停电，就算是停电也会有备用的电池保证8小时，而8小时之后没通电也会有发电机供电。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">但是好的硬件也需要好的软件才能发挥最好的功率，所以专业的IDC机房也需要专业的运维才能保证我们的服务器和网络高效率的运行。</span><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第一个是信息统计</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">，这个主要是IDC机房每天都要做的日常记录和设备的登记统计。<strong>第二个是主机监控</strong>，使用监控软件监控设备。</span><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第三个是硬件维护</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">，硬件出了问题是如何解决的。</span><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第四个是系统维护</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">，我们filecoin网络的服务器的操作系统用的都是linux的Ubuntu系统，我们要维护这个系统的稳定。</span><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">最后是网络维护</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">，主要是针对网络中的节点，保证节点的稳定。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><img title=\"1592290746910253.jpg\" alt=\"微信图片_20200616145203.jpg\" src=\"/uploads/image/20200616/1592290746910253.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">下面我就具体给大家介绍一下<strong>专业化运维</strong>里面是怎么实现的。<strong>首先是信息统计</strong>，专业的IDC机房每天都要对机房的设备进行记录，通过不间断的记录去发现可能的问题。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">比如我们机房那么多的存储机服务器、计算服务器、验证服务器等等全天开启，不能等那一台服务器坏了再去解决，每天定时记录的有时候能提前发现问题。就比如我们记录的包括服务器温度、数据存储量等等。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">温度高了就要重点检查是不是会发生的宕机的问题，如果存储总量到达一个量就会考虑是不是需要扩容保证正常使用的性能。就像我们手机你的存储容量用的越多你会发现越卡。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">而且记录的频率也会根据情况的不同而调整，比如在进行测试的时候可能我们做的记录就会更多更详细，而一般情况下我们记录可能就会宽松一点。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">除了上面的日常记录部分还要对其他信息进行统计，比如对每一个服务器的型号，序号和网络信息进行统计做备份，网络信息包含每台服务器的IP地址和子网掩码等。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第二部分是对整个网络进行监控</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">，我们有一个智能的监控系统会对包括设备和网络进行监控。</span></p><p><br/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">因为一个集群网络里面设备很多，等主网正式上线的时候可能会有上万台服务器，如果有一台机器坏了要一台台去排查肯定不效率，通过智能的监控网络我们可以看到好的机器是显示绿色的，出了问题显示黄色，损坏的就显示红色。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">通过可视化的操作管理整个网络的机器。每个机器坏了就去对应的机器去排查就可以了。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第三部分是硬件的维护</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">，比如我们filecoin网络挖矿的效率是跟文件的存储量有关的，那么存储机维护就会对产币的影响很大。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">比如说一个硬盘如果出现问题了得不到及时的处理，本来一台矿机一天能产100枚币的，可能因为那个硬盘导致效率变低导致只产出50枚币了。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我们所有的硬盘都是企业硬盘都是支持热拔插的，一旦出现问题可以带电拔出坏的硬盘换上好的硬盘而且不会损坏硬盘的数据，等修复了硬盘在对数据进行备份。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">第四部分是系统的维护</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">，我们服务器的系统使用的是linux的Ubuntu系统，它不像我们平常电脑用的Windows系统，用各种可视化的应用和见面，Ubuntu系统只有一个指令界面，我们操作都是通过敲代码的形式来对电脑进行操作。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我们系统维护主要是保证服务器系统稳定，比如出现BUG或者漏洞这种的及时修复。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">最后一个部分是网络的维护</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">。网络的维护主要是保证网络中的节点安全稳定。比如网络中的某一个节点出现问题，不在线了。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我需要从网络层面去查找是网络的问题还是设备单额问题。我们在网络维护中通常是通过指令的形式向节点IP发送数据包查询网络是否是正常的。我们一般会用是PING指令和tracert追踪指令来追踪网络的连接状态。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">如果能PING通或者能追踪到那个节点IP就说明不是我们Filecoin网络的问题,这个时候让懂设备的人员去解决就好了。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">上面这些是一般情况下如果我们的运维人员主要解决问题的情况，当然说可能还会遇到一些情况是我们运维人员没有办法解决或者权限不够的情况；</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">比如说设备突发未知错误，系统需要重启等等问题，这个时候一线的运维人员是没有办法直接解决的情况下可以通过往上级提交申请的方式解决。比如一线运维人员往二线人员提交二线再往技术总监提交等往上递交方式解决问题。</span></p><p style=\"text-align: justify; text-indent: 2em;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></span></p><p style=\"text-align: justify; text-indent: 0em;\"><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">通过上面专业的运维体系我们相信我们能保证我们Filecoin网络节点在主网上线后能稳定高效的挖到矿，带领大家共同走向财富。</span></p><p style=\"text-align: justify; text-indent: 0em;\"><a title=\"Filecoin网络节点特点和专业化运维介绍\" href=\"https://mp.weixin.qq.com/s/QgyCkMAbDgjy72KOb1DNtg\" target=\"_blank\"><span style=\"font-size: 14px;\">原文链接：https://mp.weixin.qq.com/s/QgyCkMAbDgjy72KOb1DNtg</span></a></p>','admin','1592289180','1592292224','all','0','/Public/Uploads/news/5ee86eee1592b.jpg');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('23','难怪FIL币号称“数字货币之王”！它的期货价格太抢眼！','<p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">自区块链上升为国家战略，加上两会助推，毫无疑问，区块链已成为时下最热门的产业之一，将成为国家未来发展的重点方向。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p><br/></p><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">作为时下的热点和焦点，这新一代互联网的底层系统，区块链可以融合其他新一代信息技术，提高数字经济增速，保证国民经济高速增长和高质量发展，加快转型升级。</span></p><section><br/></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">由此可见，区块链功能十分强大，但唯一不足的就是“不适合存储大量数据”，因此即使曾经风光的比特币至今全部的区块数据也才几百个G。</span></p></section><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><br/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">所幸，现今这种不足已经得到了完美解决——IPFS作为成熟的分布式存储项目应运而生。</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">它能够很好地解决当下互联网存在的数据存储瓶颈及数据存储安全性问题。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我们可以使用IPFS处理大量数据，并将不变的、永久的IPFS链接放置到区块链中，而不必将数据本身放置在区块链。这可以完美补充区块链数据存储效率低这一大缺陷。</span></p></section><p><br/></p><p><img title=\"1592464052928945.jpg\" alt=\"微信图片_20200618150505.jpg\" src=\"/uploads/image/20200618/1592464052928945.jpg\"/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">有人说，脱胎于区块链技术的IPFS可谓青出于蓝而胜于蓝。有学者通过研究认为，IPFS区块链的最高发展形式。你以为就是其受欢迎的地方？</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">更重要的是，作为成熟的分布式存储项目已经成功踏入这艘区块链的大船，左有国家重视，右有地方推动，正顺应着时代风口，快速并且顺利的前行。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><img title=\"1592464134552631.png\" alt=\"微信图片_20200618150544.png\" src=\"/uploads/image/20200618/1592464134552631.png\"/></span></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">在这样的背景下，IPFS的激励层Filecoin的发展势头自然不遑多让。Filecoin对标的是万亿级别的云存储市场。</span></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></span></span></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">当配合时下最火的新基建、央行DCEP、5G、物联网等技术的应用落地之后，Filecoin作为底层的存储层，将为整个互联网数据存储提供价值洼地，让数据存储更快、更安全、成本更低。</span></span></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><img title=\"1592464167842930.jpg\" alt=\"微信图片_20200618150553.jpg\" src=\"/uploads/image/20200618/1592464167842930.jpg\"/></span></span></p><section><section><section><section><section><section><section><section><section><section><section><section><section><section><h3 style=\"text-align: center;\"><span style=\"font-size: 18px;\">01</span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify; font-size: 18px;\">Filecoin热度持续升温</span></strong></h3></section></section><section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><br/></p></section></section></section></section></section></section></section></section></section><p><br/></p><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">目前，已临近Filecoin主网上线。据调查，其代币FIL在数字货币热搜榜位列第一，正在受到全球高度关注。那么，FIL作为目前区块链业内头号热点，其主网上线后价格会有怎样的走向呢？</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">由于FIL期货价格和买卖量高低可以间接说明市场对FIL的关注度和预期，因此人们常用期货的价格去对标、预测Filecoin主网上线后的FIL价格。<br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><br/></p></section><section><section><section><section><section><section><section><section><section><section><section><section><section><section><h2 style=\"text-align: center;\"><span style=\"font-size: 18px;\">02</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify;\">Filecoin期货价格创新高</span></strong></span></h2></section></section><section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><br/></p></section></section></section></section></section></section></section></section></section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">Filecoin的期货却早在2017就已经上线，近期，Filcoin的6月期货价格受主网即将上线的刺激，直接创下了2年新高，一度直逼13.5美元（曾一周涨幅超五成）！</span></p></section><p><br/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"></span></span><img title=\"1592464213467143.jpg\" alt=\"微信图片_20200618150559.jpg\" src=\"/uploads/image/20200618/1592464213467143.jpg\"/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">如无意外，Filecoin主网将于今年二三季度之间上线，这个经过几年技术沉淀的项目即将面世，而种种数据都在显示其关注热度和市场预期越来越高。<br/></span></p><p><br/></p><section><br/></section><p><br/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">早前，企查查（图1）和天眼查（图2）就已收录Filecoin项目，证明其项目的合法性和中国市场的关注度，并附上了融资进程。</span></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><img title=\"1592464244481175.jpg\" alt=\"微信图片_20200618150608.jpg\" src=\"/uploads/image/20200618/1592464244481175.jpg\"/><span style=\"text-align: center; color: rgb(136, 136, 136); text-transform: none; text-indent: 0px; letter-spacing: 0.54px; font-family: 楷体,楷体_GB2312,SimKai; font-size: 16px; font-style: normal; font-weight: normal; word-spacing: 0px; display: inline !important; orphans: 2; widows: 2; float: none; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">图1</span><span style=\"color: rgb(136, 136, 136); font-family: -apple-system-font, BlinkMacSystemFont, \"><img title=\"1592464288387464.jpg\" alt=\"微信图片_20200618150613.jpg\" src=\"/uploads/image/20200618/1592464288387464.jpg\"/></span></p><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: center; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; color: rgb(136, 136, 136); font-family: 楷体,楷体_GB2312,SimKai; font-size: 16px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">图2</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p></section><p><br/></p><section><section><section><section><section><section><section><section><section></section></section></section></section></section></section></section></section></section><p><br/></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><span style=\"color: rgb(136, 136, 136); font-family: -apple-system-font, BlinkMacSystemFont, \"></span></p><section><section><section><section><section><section><section><section><section><section><section><section><section><section><h2 style=\"text-align: center;\"><span style=\"font-size: 18px;\">03</span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; text-align: justify; font-size: 18px;\">Filecoin价值无限</span></strong></h2></section></section><section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><br/></p></section></section></section></section></section></section></section></section></section><p><br/></p><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">目前，Filecoin官方对于中国矿工社区的关注程度也越来越高，在Slack中，官方成员也会用“蹩脚”的中文回应矿工们的问题：随着中国Filecoin社区的影响力越来越大.</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">近日，Filecoin官方——协议实验室最新发布一条招聘信息：寻求一名中国战略师，以完全专注于Filecoin在中国这个不断发展的重要社区，中国是Filecoin最有价值的市场之一！<img title=\"1592464389194320.jpg\" alt=\"微信图片_20200618150619.jpg\" src=\"/uploads/image/20200618/1592464389194320.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">如此一来，也越来越多人相信Filecoin项目的好前景以及官方对我国的热情了！</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">更重要的是，在主网还没上线的情况下，但是其测试活跃度，已经超越了其它绝大区块链项目的链上活性。目前，大家都忙着布局“抢头矿”，Filecoin已涨过13美元！</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">目前正是加密数字货币领域重新洗牌的阶段，而Filecoin价值正在肉眼可见的上涨。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">我们完全有理由相信，Filecoin 凭借着存储大量价值数据，一定能在各类数字货币中脱颖而出，成为新的“数字货币之王”！<br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">捕获其在IPFS中的最大价值，当然要学会先挖币——这就涉及“抢头矿”了。</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span><br/></p></section><p><br/></p><p style=\"margin: 5px 16px; padding: 0px; text-align: center; color: rgb(51, 51, 51); text-transform: none; line-height: 1.75em; text-indent: 0px; letter-spacing: 0.54px; clear: both; font-family: -apple-system-font,BlinkMacSystemFont,\"><br/></p>','admin','1592463997','1592464662','all','0','/Public/Uploads/news/5eeb1294d1eb6.jpg');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('24','为什么Web3.0需要IPFS和Filecoin？600+开发者告诉你','<section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">近期，国外有团队发表了一篇<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">关于分布式Web开发现状的报告</strong>，其调查对象是600+各国的Web3.0开发人员。</span></section><p><br/></p><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">在对比开发者心目中现行网络与DWeb（分布式网络）的差异后，他们得出了这样的结论：</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><p><br/></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><li><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">DWeb还未成熟，目前为止还不能被一般用户理解；</span></p></li><li><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">在DWeb的构想中，数据隐私、主权和技术弹性是最令人期待的；</span></p></li><li><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">现行互联网协议中，最令人担心的是DNS，其次是通信层和HTTP；</span></p></li><li><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">IPFS与以太坊是目前开发者们首选的技术。</span></p></li></ul><p><br/></p><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span><br/></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">以此展开，我们来细品为什么Web3.0需要IPFS和Filecoin？</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><section><section><section><section><section><br/></section><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Web现状</strong></p></section><section><br/></section></section></section></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">近几年的网络弊端/负面事件频发，最大痛点暴露无遗：</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">集中的数据存储以及随之而来的不利影响——从数据泄露到主要技术公司和政府的中心化审查</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">。<p style=\"text-align: justify;\"><img width=\"659\" height=\"277\" title=\"1592641869479318.png\" style=\"width: 659px; height: 277px;\" alt=\"微信图片_20200620163036.png\" src=\"/uploads/image/20200620/1592641869479318.png\"/></p></span></span></section></section></section><section></section><p><br/></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><li><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">五大痛点</span></strong></p></li></ul><p><br/></p><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">（68.5%）个人数据泄露</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">（66%）审查</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">（65%）访问限制</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">（61%）基于个人数据的广告推送</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">（53%）应用程序保存的用户数据</span></strong></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">但其实对于用户而言，不论现行网络带来多少弊端，Web2.0其实已经很好的满足了我们的需求，比如便捷社交、比如快速获取信息；这些便捷所带来的不利影响，只是间接困扰到我们，感知不明显。</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">这就造成了Web3.0发展局限在小范围的关键原因：<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Web3.0的发展仅凭开发者们的意识推动，而并没有被一般用户理解</strong>。</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">正如上一篇文章内所写的一样，Filecoin的付费检索想要取代现行网络，还有漫长的路要走。（详情可参考</span><a style=\"margin: 0px; padding: 0px; color: var(--weui-LINK); text-decoration: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); cursor: pointer; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\" href=\"http://mp.weixin.qq.com/s?__biz=MzU4Mzk2Mzc3Mg==&mid=2247492710&idx=1&sn=752b13a62325af93d16f0d02dcacf50c&chksm=fda3a175cad42863ae22d0de0ac7932534435c68e6ac01799c993f95f13199fd6e6d4ee8406b&scene=21#wechat_redirect\" target=\"_blank\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">《付费的Filecoin如何取代“免费”的互联网？》</span></strong></a><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">）</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><section><section><section><section><section><br/></section><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">创造Web3.0的使命</strong></p></section><section><br/></section></section></section></section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-size: 17px; letter-spacing: 0.544px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">那么对于当前网络，我们的当务之急，或者说使命就是从以下几个方面着手，逐步改变网络不良生态：<img title=\"1592641908354386.png\" alt=\"微信图片_20200620163044.png\" src=\"/uploads/image/20200620/1592641908354386.png\"/></span></p><section></section></section></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">1.&nbsp;（75%）数据主权归还用户</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">2.&nbsp;（59%）用更加匿名的方式保护数据隐私</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">3.&nbsp;（56%）针对毁灭性事件采取的技术弹性</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">4.&nbsp;（51%）用密码学技术保护安全</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">5.&nbsp;（42%）拥有匿名获取资源的权利</span></strong></span></section><section><br/></section><section><section><section><section><section><section><br/></section><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">解决之道</strong></p></section><section><br/></section></section></section></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">想要实现这些，开发者们认为以下的技术是至关重要的（至少目前来说没有更好的）：<p style=\"text-align: justify;\"><img width=\"608\" height=\"513\" title=\"1592641931305052.png\" style=\"width: 608px; height: 513px;\" alt=\"微信图片_20200620163048.png\" src=\"/uploads/image/20200620/1592641931305052.png\"/></p></span></section></section></section><section></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">1. （55%）P2P通信协议</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">2.&nbsp;（54.5%）内容可寻址存储</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">3.&nbsp;（51%）P2P文件共享</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">4.&nbsp;（47%）去中心化DNS</span></strong></section><section><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">5.&nbsp;（46%）关注隐私的网络</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \"></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><section><section><section><section><section><br/></section><section><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">IPFS&amp;Filecoin</strong></p></section><section><br/></section></section></section></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">当然，目前已经有很多项目开始着手采用这些关键技术进行自己的构建。</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">那对于开发者而言，他们更喜欢这些：</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;<p style=\"text-align: justify;\"><img width=\"633\" height=\"428\" title=\"1592641951985124.png\" style=\"width: 633px; height: 428px;\" alt=\"微信图片_20200620163052.png\" src=\"/uploads/image/20200620/1592641951985124.png\"/></p></span></section></section></section><section></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">1.&nbsp;（36%）IPFS</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">2.&nbsp;（25%）以太坊</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">3.&nbsp;（14%）DAT</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">4.&nbsp;（13%）ActivityPub</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); font-family: \">5.&nbsp;（12%）Libp2p&amp;WebTorrent</span></strong></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">IPFS，希望取代HTTP而出现的去中心化通信协议，所采用的P2P、内容可寻址、加密等技术，都可以很好地保护网络通讯中的数据隐私，做到抗审查；</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">其切片保存与传输的技术，以及冗余存储，更能够对抗毁灭性灾难，比如自然灾害或者被人为关停。</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">&nbsp;</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">Filecoin，基于IPFS和区块链技术诞生的数据买卖市场，其存储、检索的功能不仅保护了数据的隐私，将数据的所有权重新归于个人；更是保护了数据的价值，让所有者通过数据而获利。</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \"><br/></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">可以说，无论是IPFS使用的技术，还是Filecoin能够实现的功能，都完美契合了开发者们想解决、想使用的，也是Web3.0最需要的。</span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \"><br/></span></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: \">40%的选择也是必然。</span></section><section><br/></section><section><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">参考文献：<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">《<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255); color: rgb(41, 41, 41); font-family: medium-content-title-font, Georgia, Cambria, \">Decentralized Web Developer Report 2020</span>》</strong></span></section><section><br/></section><p><br/></p><p><br/></p>','admin','1592641651','1592642944','all','0','/Public/Uploads/news/5eedcb75f27c9.jpg');/* MySQLReback Separation */
