 INSERT INTO `ds_announce` VALUES ('27','主网即将上线，胡安第四次线上AMA解答的问题，你都看懂了吗？','<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">6月26日上午，Filecoin项目创始人胡安举行了在线问答活动，这也是面向社区第四次AMA活动。在10点-11点一个小时里，胡安针对主网窗口期、大矿工测试、400万FIL测试奖励等问题，进行深度探讨。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">针对线上问题环节，为大家整理了重要问答，以下是精彩问答全程收录：<br/></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); font-size: 15px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><br/></span></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(84, 141, 212); letter-spacing: 5px; font-family: -apple-system-font,BlinkMacSystemFont,\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; overflow-wrap: break-word !important;\"></strong></span><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; overflow-wrap: break-word; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\"></span><span style=\"background-color: rgb(255, 255, 255); box-sizing: border-box; color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: 5px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; orphans: 2; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\"><strong style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"><br/></strong></span><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题1</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">Q1:</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">影响filecoin上线后大家接存储单的因素是什么？算法？还是硬件？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">A1:</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">为了最大化让矿机接单，矿工需要大量存储空间，很好的网络连接和比较好的硬件（AMD比intel好）。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题2</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q2:</strong>官方硬盘对7月20号开始的测试网奖励是否有影响</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A2:</strong>官网硬盘和测试网奖励无关。测试网奖励比的是纯算力、交易的完成和执行扇区的生命周期的能力。官方硬盘和验证用户机制都不会对测试网奖励造成任何影响。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题3</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q3:</strong>有人问之后采用NSE算法的可能性有多大？AMD现在是否是最适合现在的SDR算法的？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A3:</strong>NSE是算法升级的最佳候选之一，所以官方团队在整合代码。但是NSE不是唯一的候选，还有其它也很不错的算法。所以有可能之后官方团队会选择比NSE更好的其它算法——现在还不确定。算法升级会在主网上线之后而且会和现在算法并行。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题4</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q4：</strong>主网上线前lotus和go-filecoin的算法和逻辑层有什么变化？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A4：</strong>从现在开始，算法和逻辑在上线前不会有任何变化了。官方团队现在做的只是在修复bug，提高性能（现在最新的测试网上的区块同步比以前快了许多），通过新的API和文档改善用户体验。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题5</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q5:</strong>在接下来的测试网奖励中，官方如何确认矿工的真实所在地？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A5:</strong>我们会用一系列技术性和非技术性的机制，针对不同的矿工，手段可能也不同。为了避免作弊，我们不会在进行所在地确认前公布具体的机制。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">当我们确认矿工所在地时，我们会通过电邮联系矿工，然后确定一个矿工可以在线提供证明的时间。我们会要求矿工提供一些特定的证据并且在一个相对短的时间内要求矿工提交这些证明。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px; letter-spacing: 1.5px;\">在竞争比较强烈的区域参赛的矿工则不需要提供所在地证明。</span><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">我们会把存储和封装硬件的所在地认定为矿工的所在地（比如矿机在美国接入，官方就会认为这个矿工所在地是美国，不管矿工本人真实在哪个国家）。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">请注意，尝试篡改自己所在地的矿工将不会获得任何奖励。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><br/></span></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题6</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q6:</strong>如果矿工大量的投入设备，后期算法更改对矿工带来的损失会是怎样的？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A6:</strong>我们预计会有两种证明升级：（1）可选的效率升级，仅用于添加更便宜或更快速的新证明构造；以及（2）强制性安全升级，其中我们发现算法问题并必须强制网络迁移到新算法或一组不同的参数。对于（1）效率升级，我们希望这些升级是可选的并且共存，并且仅在矿工和客户选择使用它们时才使用。我们预计每年有0、1或2个。-对于（2）强制性安全升级，这些将带有某种过渡计划，试图将网络成本降至最低。我们不期望发生这些，但是可能会发生。</span></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; text-align: left; color: rgb(84, 141, 212); text-transform: none; text-indent: 0px; letter-spacing: 5px; font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; max-width: 100%; box-sizing: border-box; orphans: 2; -webkit-text-stroke-width: 0px; overflow-wrap: break-word; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"><br/></strong></span></h2><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题7</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q7:</strong>如何实现测试网奖励中的网络检索和真实数据？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A7:</strong>在竞赛中，一旦你的矿机的算力＞0，很多机器人就会开始跟你的矿机建立存储和检索交易。竞赛数据页上会以接近真实时间的频率显示你的交易真实率。低于一定没看的矿工就没有奖励了。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\">我们将会在竞赛前1-2周就开始把机器人跑起来，给矿工一个测试自己矿机配置的机会，一旦机器人跑起来，我们会发通知。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp; <span style=\"color: rgb(84, 141, 212); font-size: 20px; box-sizing: border-box; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">问题 8</strong></span><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); letter-spacing: 5px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">&nbsp;</span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong></span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q8:</strong>SDR用法要用到主网上线后6个月？Filecoin上线后会启用NSE或者其它算法吗？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A8:</strong>我们在开发中有其它的选项，包括NSE和其它算法。主网上线后，我们会在网络升级中通过FIP（Filecoin优化建议）来提交这些选项。我们希望主网上线6-12个月内，会有至少1个更块更便宜的算法上线，但是具体时间受到很多具体因素的限制，无法确认。需要注意的是，新的算法会与SDR共存，所以新的算法是可供矿工选择的（并不是必选）。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\">&nbsp;<span style=\"font-size: 20px;\"><span style=\"color: rgb(84, 141, 212); box-sizing: border-box; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">问题 9</strong></span><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); letter-spacing: 5px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">&nbsp;</span></strong></span></span><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); letter-spacing: 5px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></span></strong></span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q9:</strong>如何把承诺容量扇区变为存着真实数据的扇区？当真实交易发生时，承诺容量扇区会自动被真实数据覆盖吗？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A9:</strong>承诺容量扇区就像是平台经济中的一辆空着的滴滴。当供大于求时，矿工向网络承诺容量，等需求出现了，就把这些容量的真实数据来赚取额外奖励。在协议的第一代中，我们会复用很多现存的代码路径。矿工会发布他们的存储交易，向链广播他们在做升级，然后证明升级成功完成了。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h3 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题10</span></h3><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q10:</strong>矿工需要做什么操作来把承诺容量扇区变成真实数据扇区？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A10:</strong>在第一代协议中，我们复用了很多现存的代码路径。矿工会公布他们用来升级承诺容量扇区的真实交易，向链上广播他们在做升级，然后向链证明他们正确的完成了新扇区的封装。主网上线后我们会逐步优化这一过程。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题11</span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q11:</strong>机器人发起交易的频率是什么？影响频率的因素是矿工节点、真实的交易时间段、还是为了最大化不同硬件设置的承受力？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A11:</strong>频率会根据矿工添加承诺容量的速度而增加。但是基本上会是随机的，以模仿真实的交易市场情况。</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><h2 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; color: rgb(84, 141, 212); letter-spacing: 5px; font-family: -apple-system-font,BlinkMacSystemFont,\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; overflow-wrap: break-word !important;\"></strong></span><span style=\"color: rgb(84, 141, 212); font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: 5px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; orphans: 2; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\"><strong style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"><span style=\"background-color: rgb(255, 255, 255); box-sizing: border-box; color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: 5px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; orphans: 2; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\"><strong style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; max-width: 100%; overflow-wrap: break-word; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"><span style=\"display: inline !important; float: none; background-color: rgb(255, 255, 255); color: rgb(84, 141, 212); font-family: sans-serif; font-size: 20px; font-style: normal; font-variant: normal; font-weight: 700; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">问题12</span></strong></span></strong></span></h2><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">Q12:</strong>主网是否会按照原定计划7.20-8.21上线？</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">A12:</strong>正如我们昨天在路线图更新中提到的那样，我们在继续沿着原定计划稳步前行，目前预计可能会在这个窗口期的后段（更接近8.21）上线。不过所有日期仍然是最佳预计，我们的首要任务是保证主网的安全和稳定运行。</span></p><h3 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\"><br/></span></h3><h3 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题13<span style=\"font-size: 20px;\">&nbsp;</span></span></h3><div><span style=\"color:#001000\">Q13:矿工是否要做KYC验证？怎么验证？<br/>A13:为了收到测试网中的测试奖励token，矿工必须通过提交护照或者类似的身份证件来验证自己的身份。在某些不常见情况下，我们可能会需要矿工提供额外的信息。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题14</span><span style=\"color:#001000\">&nbsp;</span></h3><div><span style=\"color:#001000\">Q14:验证者的标准和条件是什么？验证者是指定机构吗？能给我们讲讲吗？<br/>A14:会有多个不同的机构作为验证者，目前这一块还没有任何更新，7月中旬会有更多信息。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题15&nbsp;</span></h3><div><span style=\"color:#001000\">Q15:我们买了很多官方硬盘，什么时候才能发往中国大陆？<br/>A15:验证交易结构和相关联的加密经济参数还有很多细节没有确定。我们的目标是先确认哪些细节再寄出硬盘，但是就现在的时间线来看，我们在考虑在参数设定好之前，让团队先接受这些硬盘的购买凭证。<br/></span></div><h3 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\"><br/></span></h3><h3 style=\"margin: 0px; padding: 0px; text-align: center; color: rgb(51, 51, 51); clear: both; min-height: 1em; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题16&nbsp;</span></h3><div><span style=\"color:#001000\">Q16:有效数据怎么在竞赛中认定并存储？&nbsp; &nbsp;<br/>A16:有效数据不会在测试网被验证，已验证用户不是测试网激励比赛的一部分。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题17&nbsp;</span></h3><div><span style=\"color:#001000\">Q17:Filecoin矿池的出现会不会使团队的分布式存储的想法偏离了初衷？<br/>A17:不会——Filecoin其中一种建立去中心化存储的网络的有效手段就是大力降低存储矿工提供存储的门槛。即使出现的大型矿池，任何人都还是可以通过购买简单的硬件来加入网络提供存储。而且我们认为客户会把自己的文件存在不同的矿工那里。<br/>另外，矿工的所在地也会对交易有影响。因为很多客户会对矿工所在地有所选择，这样一来全球的的矿工都有机会，只要当地有存储需求。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题18&nbsp;</span></h3><div><span style=\"color:#001000\">Q18:如果有人可以给filecoin网络带来很多“验证客户”或者高质量的商业用户，官方有相应的奖励机制吗？<br/>A18:我们认为矿工会通过竞争来获取验证用户的交易，因此可能也会产生一些矿工和荣誉用户之间的合作关系。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题19</span><span style=\"color:#001000\">&nbsp;</span></h3><div><span style=\"color:#001000\">Q19:官方建立的安全检查机制有什么更新吗？发现了什么新的、重大的bug吗？<br/>A19:2周后，会有一个网站来展示bug提交、安全检查并且提交新的报告。我们也爱几乎引入类似以太坊的那种公开赏金机制。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题20&nbsp;</span></h3><div><span style=\"color:#001000\">Q20:在Filecoin上存储数据会比在中心化的云服务上存储便宜吗？如果是的话，什么时候可以实现？<br/>A20:Filecoin建立了一个数据存储的强竞争力市场——市场中会有很多矿工挂不同的价格，而不像现在的中心存储市场那样价格固定。我们认为以Filecoin这种不需要审查和低门槛参与的模式会带来一些非常高效且低价的出处，但是现在主网上线前，存储价格不好预测。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题21&nbsp;</span></h3><div><span style=\"color:#001000\">Q21:Filecoin测试网奖励和主网上线后，矿机需要固定IP吗？<br/>A21:主网上线后，你需要公共IP，但是不需要是固定的（只要能获取就行）。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题22</span><span style=\"color:#001000\">&nbsp;</span></h3><div><span style=\"color:#001000\">Q22：Filecoin的加密经济模型的具体参数什么时候可以公布？<br/>A22：加密经济模型的具体参数还在最终确认中，这些参数还会进一步变化。我们预计更多的最终参数会在7月底确认。如果你还有关于这方面的问题，请联系我们。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题23&nbsp;</span></h3><div><span style=\"color:#001000\">Q23:如果我们意外丢失了一个扇区，有什么办法可以恢复吗？<br/>A23:如果你丢失了数据，那么没有办法可以恢复，你的算力将会被惩罚。但是如果数据本身是可以恢复的（假设你只是错过了一个WindowPost），那么恢复程序可以让你重新恢复这个扇区。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题24&nbsp;</span></h3><div><span style=\"color:#001000\">Q24:奖励测试中机器人会给矿工发多大的数据？<br/>A24:从几KB到完整的32G扇区不等。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题25</span><span style=\"color:#001000\">&nbsp;</span></h3><div><span style=\"color:#001000\">Q25:矿工和客户之间的存储交易的最短时长是多久？<br/>A25:交易的最短市场是矿工提单的时候定的。但是也有最低限制，因为扇区有最短的生命周期（目前是1个月)。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题26&nbsp;</span></h3><div><span style=\"color:#001000\">Q26:在测试网奖励细则中，官方提到：矿工必须完成扇区的完整生命周期并终止扇区。终止扇区是什么意思？<br/>A26:当承诺容量扇区上链后，它可以被升级为存有真实交易的扇区，延长其生命周期或者通过错误或自愿的选择来终止扇区。虽然我们不认为主网上线后这种情况会经常出现，但是矿工可能会认为终止他们对网络和对客户的承诺并接受惩罚是理智的选择。我们希望矿工完成扇区的完整生命周期，感受在Filecoin网络中提供长期和有用存储的感觉。</span></div><h3 style=\"text-align: center;\"><span style=\"color: rgb(84, 141, 212); font-size: 20px;\">问题27&nbsp;</span></h3><p><span style=\"color:#001000\">Q27：为什么不实行白皮书中提到的“矿工和客户通过下单簿自动成交”？是因为TPS的限制吗？<br/>A27：链下下单簿和矿工市场会共存——有些还在开发中。这些大多都是链下行为，因为链上TPS不足以支撑Filecoin的使用体量。这些下单簿建立在基础的链上交易流上。他们会按照自己的开发轨道来上线——很有可能在主网上线前后。</span></p><p><span style=\"color:#001000\"><br/></span></p><p><span style=\"color:#001000\"><br/></span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p>','admin','1593316137','1593501205','all','0','/Public/Uploads/news/5ef8180f162e3.png');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('28','广东星际元科技有限公司关于新产品上架的通知','<p style=\"text-align: center;\"><img title=\"1594007396149188.jpg\" alt=\"微信图片_20200702122507.jpg\" src=\"/uploads/image/20200706/1594007396149188.jpg\"/></p>','admin','1594007334','1594007487','all','0','/Public/Uploads/news/5f029f542e70f.jpg'),('29','广东星际元科技有限公司关于产品下架的通知','<p style=\"text-align: center;\"><img title=\"1594018553423783.png\" alt=\"微信图片_20200706145353.png\" src=\"/uploads/image/20200706/1594018553423783.png\"/></p>','admin','1594018499','1594018499','all','0','/Public/Uploads/news/5f02cae5764da.jpg'),('31','Filecoin官方宣布：应社区要求为矿工新增2周的校准期','<p style=\"text-align: center;\"><img title=\"1594799721496076.jpg\" alt=\"微信图片_20200715155501.jpg\" src=\"/uploads/image/20200715/1594799721496076.jpg\"/></p><p><br/></p>','admin','1594798927','1594971927','all','0','/Public/Uploads/news/5f1157152a622.jpg');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('32','官方 | Filecoin测试奖励计划延期两周，主网启动窗口调整','<p><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">在进入Filecoin主网发布的最后阶段，Lotus（Filecoin参考实现）取得快速进展，包括数据传输改进、完成扇区生命周期功能、升级承诺容量扇区等。本周，Filecoin 测试网的在线存储容量已突破20PB。<img title=\"1594971635530977.jpg\" alt=\"微信图片_20200717154002.jpg\" src=\"/uploads/image/20200717/1594971635530977.jpg\"/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">下一个重要里程碑是启动Filecoin测试网激励计划，即Filecoin空间竞赛，旨在对网络进行压力测试。在这场为期3周的比赛中，全球前100名矿工以及来自各大洲的前50名矿工，将根据他们和网络在竞争期间实现的存储容量获得Filecoin奖励。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">除了奖励竞赛优胜者外，奖励的Filecoin通证还旨在帮助矿工在Filecoin主网上快速完成其存储容量，其他优化正在进行中，以使这一过程更加顺利。</span></p><section><section><section><section><section><section><section><section><section><section><section><section><h3 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px; color: rgb(0, 82, 255);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">新奖励计划</strong></span></h3></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span></p></section></section></section></section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">除了启动存储容量——验证Filecoin网络的重要部分旨在为人类信息创建一个去中心化、高效和稳健的基础，目的是测试Filecoin区块链中实际的区块挖掘。一旦主网启动，这将是矿工通过运营网络获得奖励的主要方式之一。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">因此，为了确保测试网的激励竞赛能够模拟主网的动态，我们很高兴地宣布，额外的10万枚FIL奖励将按比例分配给20个最大的区块奖励优胜者。这个额外的奖励将遵守与存储竞赛相同的规则和要求，并拥有自己的排行榜。<br/></span></p><p><img title=\"1594971706274710.jpg\" alt=\"微信图片_20200717154128.jpg\" src=\"/uploads/image/20200717/1594971706274710.jpg\"/></p><section><section><section><section><section><section><section><section><section><section><section><h3 style=\"text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px; color: rgb(0, 82, 255);\">Filecoin Bug奖励计划</span></strong></h3></section><section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span></p></section></section></section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">运行测试网激励计划是主网启动前的关键一步，它可以在主网上线之前识别并修复任何bug或关键的安全问题。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">因此，我们强烈鼓励竞赛参与者使用这个测试网来评估和报告他们在Filecoin协议或参考实现中可能发现的任何潜在攻击、问题或漏洞。欢迎对网络进行压力测试，尝试进行破坏，并报告您遇到的任何问题！</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br/></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">为此，我们将通过新的Filecoin bug奖励计划奖励参与者，以获得帮助改善网络的Filecoin。在Filecoin空间竞赛之前，我们还将在bug bounty网站上宣布更多的目标和奖励。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p></p><section><section><section><section><section><section><section><section><section><section><section><h3 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 82, 255);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\">奖励计划时间调整</span></strong></span></h3></section><section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span></p></section></section></section></section></section></section></section><p></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">原计划在7月20日推出的Filecoin测试网激励计划，调整为在持续3周的比赛前增加2周的校准期，即7月20日至8月2日，校准期内矿工们将能够在真实的竞争条件下进行练习，并查看各自的表现如何影响竞争排名。8月3日开启为期3周的正式比赛。</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">竞赛还将为参赛者举办多项活动：</span></p><p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><br/></p><p></p><section><ul class=\" list-paddingleft-2\" style=\"margin: 0px; padding: 0px 0px 0px 2.2em; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><li><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">开闭幕式</span></p></li><li><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">AMA与竞赛组织者一起回答有关网络激励、计划结构和资格规则等问题</span></p></li><li><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">赛会旨在帮助矿工更好地了解Filecoin加密经济参数的更新、最近几周在Lotus推出的新功能、如何有效配置挖矿设备以充分利用竞争优势等等</span></p></li><li><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">有Filecoin社区参与者的AMA</span></p></li><li><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">参与团队展示其设置的机会</span></p></li><li><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">更多精彩敬请期待！</span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span></p></li></ul></section><section><section><section><section><section><section><section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span></p><section><section><section><section><h3 style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px; color: rgb(0, 82, 255);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">路线图更新</strong></span></h3></section><section></section></section></section></section><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span></p></section></section></section></section></section></section></section><p></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">空间竞赛是一个关键的窗口，用于修复关键错误、操作设置时间和测试网激励计划之后的最终参数优化。因此，Filecoin主网启动窗口更新为8月31日至9月21日。<img title=\"1594971790504606.png\" alt=\"微信图片_20200717154249.png\" src=\"/uploads/image/20200717/1594971790504606.png\"/><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \">我们将保持对Filecoin项目路线图甘特图的更新，以提供即将到来的里程碑的最新估计，感谢广大贡献者与我们一起建设。</span></span></p><p style=\"margin: 5px 16px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"></span><br/></p><p><br/></p>','admin','1594971580','1594972357','all','0','/Public/Uploads/news/5f1156d38f872.jpg');/* MySQLReback Separation */
 /* 插入数据 `ds_announce` */
 INSERT INTO `ds_announce` VALUES ('33','Filecoin全球矿工社区会议 官方重点解答了这些问题','<p style=\"text-indent: 2em;\"><strong><span style=\"color: rgb(84, 141, 212);\">7月22日早上9点，协议实验室举行了全球矿工社区会议，主要为8月即将进行的“太空竞赛”，针对FIL挖矿的细节做一些讲解。</span></strong>会议中，官方针对广大矿工关心的问题，给予了详细的解答和中肯的建议。以下，星际特工把本次全球矿工社区会议的重点内容，分享给大家。</p><p><br/></p><p><strong><span style=\"color: rgb(84, 141, 212);\">本次矿工大会的重点内容：</span></strong></p><div>　　1. 大矿工测试网络启动周在8月3日开始。</div><div>　　2. Calibration网络启动日期：7月20日 — 8月2日。</div><div>　　3. 经济模型参数已经进入代码阶段，但离最终版还是有距离。</div><div>　　4. 存储能力和Deal的成功率是决定奖励收益的关键。</div><div>　　5. 大矿工测试主体可以合并16个矿工号。</div><div>　　6. bot建立在欧洲，中国的矿工需要提前进行网络环境等测试。</div><div>　　7. 奖励测试中新增的10万FIL奖励将按全网区块打包排名，并参照原奖励分发给排名前 20 的矿工。</div><div>　　8. 为确保本次比赛的公平公正，官方将使用技术来验证矿工地址信息，任何试图伪造位置的人将被公开，禁止参与比赛以及取消比赛资格。</div><p><br/></p><p><strong><span style=\"color: rgb(84, 141, 212);\">Filecoin现状播报：</span></strong></p><div>　　<span style=\"color: rgb(84, 141, 212);\">Filecoin，旨在建立一个分布式数据买卖市场，矿工通过安全存储客户的文件来获取FIL收益。现阶段，Filecoin已经成功地收获了这些：</span></div><div>&nbsp; &nbsp; &nbsp;&nbsp; 4个实现</div><div>　　200+报告提交，包括APIs、核心代码等</div><div>　　1350累积OSS贡献</div><div>　　全球活动，遍地开花</div><div>　　已经达到25P的存储</div><div>　　越来越多的社区矿工</div><div>　　...</div><div>　　当然，更少不了现在正在进行中的各类官方活动，HackFS、Space Race。</div><div>　　<span style=\"color: rgb(84, 141, 212);\">目前，官方的甘特图已经更新，主网窗口期改为8月31日~9月21日。</span></div><div>　　在分享中，Colin尤其提到社区矿工为整个Filecoin做出的贡献，并在结束再次表达感谢。</div><p><br/></p><p><strong><span style=\"color: rgb(84, 141, 212);\">让我们先来回顾一下：</span></strong></p><div>　　<span style=\"color: rgb(84, 141, 212);\">该测试时间为三周，8月3日这一周启动；</span></div><div><span style=\"color: rgb(84, 141, 212);\">　　奖励随存储量增加，最高400万FIL；</span></div><div>　　实时排行榜，我们能通过这个榜单了解各家实力；</div><div>　　矿工接收官方机器人的订单，越多越好；</div><div>　　区块收益有另一个排行榜，最高20名可瓜分10万FIL的额外奖励。</div><div>　　想要参与竞争，官方给出了一些指标：</div><p style=\"text-indent: 2em;\">原值算力</p><p style=\"text-indent: 2em;\">真实存储的交易成功率</p><p>　　扇区生命周期</p><p style=\"text-indent: 2em;\">区块奖励</p><div style=\"text-align: left;\"><strong><span style=\"color: rgb(84, 141, 212);\">Colin根据大家在此之前提的问题做了重点解答：</span></strong></div><p style=\"text-indent: 2em;\"><span style=\"color: rgb(84, 141, 212);\">重点解答整理</span></p><div>　　<span style=\"color: rgb(255, 192, 0);\">Q: 哪些区域可以参与测试激励竞赛？</span></div><div>　　A:&nbsp; 除了南极洲以外的六大洲：北美洲，南美洲，非洲，亚洲，欧洲，大洋洲。</div><p style=\"text-indent: 2em;\"><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q: 测试激励竞赛的衡量标准是什么？</span></p><div>　　A: 测试奖励的一个重要标准是真实存储交易的成功率，交易成功率必须要高于一个标准（标准待定）才能获得奖励；此外，矿工想要获得奖励，还需要保证能够通过扇区升级的方式将承诺容量变为所能给客户提供的真实存储的空间。</div><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\"><br/></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q:&nbsp; 哪个Lotus的分支网络将用于大矿工测试？</span></p><div>　　A:&nbsp; 目前已经开启的校准网络现在在ntwk-calibration分支网络上运行，我们将会在8月3日前宣布用于测试激励竞赛的网络。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q:&nbsp; 为什么测试奖励计划只奖励部分的矿工，而不是所有参与者？</span></p><div>　　A: 我们必须对获得奖励的每个矿工进行AML（反洗钱） / KYC（实名认证），但是在主网启动之前的短时间内对成千上万的矿工这样做是不切实际的。尽管如此，我们仍然希望有更多的矿工都有资格获得奖励。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q: 中国矿工是否需要VPN来接收交易？</span></p><div>　　A:&nbsp; 对于中国矿工来说，能够成功地连接世界各地是非常必要的。因此，无论主网还是测试网，你都需要有一个可连接的状态。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q: 机器人在哪里？来自中国的矿工是否需要VPN来接收机器人的交易？</span></p><div>　　A:大矿工测试中的数据存储交易由官方机器人来完成，机器人设置在欧洲，官方并不提供单个连接的帮助，矿工需要先测试能否和Filecoin上的程序相连接。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q：我可以将多个矿工合并为一个，已达到竞争能力最大化吗？</span></p><div>　　A：一个节点最多容纳16名矿工，只需使用相同的电子邮件注册。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q：我们在同一个区域内两个不同的数据中心安装了设备，我们能把两套设备的存储能力结合起来吗？</span></p><div>　　A：对于大矿工来说，可以的，只要你是使用相同电子邮件注册的两位矿工，你需要按照Filecoin中的slack中的space-race频道中给出相关的说明操作就行了。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q：我是否可以提前模拟大矿工测试的竞赛情况，以测试我的方案配置 ？</span></p><div>　　A：是的，我们已经开启了为期两周的校准网络（7.20-8.2）。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q：Filecoin&nbsp; Discover可以跳过密封阶段吗？</span></p><div>　　A：不，数据都需要密封，也就是说，Filecoin&nbsp; Discover硬盘对于参与大矿工测试而言，并没有优势。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q：你们会发布最新的硬件基准吗？</span></p><div>　　A：协议实验室无法给出任何具体硬件配置的建议，但是我们已经发布了我们自己使用的一些硬件配置，包括目前适合测试机器的参数，具体信息可以留意社区和官方消息。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q:&nbsp; 经济模型的具体参数何时公布？</span></p><div>　　A:&nbsp; 经济模型的初步参数已经进入代码阶段，具体参数仍然有待确定。</div><p><br/></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(255, 192, 0);\">Q：在主网上，Discover硬盘里的数据会跳过封装阶段吗？</span></p><div>　　A：不会，Discover中的数据仍然需要进行封装。<br/></div><p><br/></p>','admin','1595473532','1595473532','all','0','/Public/Uploads/news/5f19019c41e36.jpg');/* MySQLReback Separation */
