 INSERT INTO `ds_announce` VALUES ('34','8月，对于Filecoin矿工们而言将是充满挑战！跟随胡安，一起期待Filecoin的起飞！','<div>8月，对于Filecoin矿工们而言将是充满挑战，又令人期待的，昨天<strong>创始人Juan Benet</strong>通过Twitter兴奋的与矿工们分享目前Filecoin Ignite 8月的一系列活动——EPIC月就要来了！</div><div>接下来，我们就跟随胡安的Twitter，一起来期待下8月Filecoin项目的起飞吧！</div><p><img title=\"1596593603111662.png\" alt=\"微信图片_20200805101321.png\" src=\"/uploads/image/20200805/1596593603111662.png\"/><img title=\"1596593673624117.png\" alt=\"微信图片_20200805101444.png\" src=\"/uploads/image/20200805/1596593673624117.png\"/></p><div><strong>1、HackFS</strong></div><div>HackFS 是ETHGlobal和Protocol Labs主办的线上黑客马拉松活动，致力于为Filecoin项目的应用奠定基础。与Protocol Labs——创立Filecoin和IPFS的组织一同合作举办这场活动，聚焦于dapps、web3.0、分布式存储等核心。</div><div>官方协议实验室还与以太坊和Filecoin生态内的其他伙伴共同合作以确保参与者可以使用各种可组合的技术来进行他们的技术创作。</div><div>在ETH Global举办的Hack Money——产生120个项目的DeFi黑客马拉松活动获得了成功。因此，HackFS将为开发者提供最高水准的白手套体验，他们可以自行确定要解决的问题、设计解决方案和进行技术开发，最终将其展现给评审团甚至是整个web3.0社区。</div><p><img title=\"1596593712331249.png\" alt=\"微信图片_20200805101523.png\" src=\"/uploads/image/20200805/1596593712331249.png\"/></p><div><strong>2、Space Race</strong></div><div>宣布Filecoin的Testnet奖励</div><div>经过多年的研究和开发，Filecoin的主网发布已经临近。官方宣布了Filecoin的testnet奖励计划，并邀请世界各地的矿工参与Mineing Competition竞争以赢得总计达400万个Filecoin代币的全球和区域性资金池。</div><div>奖励计划的内容</div><div>testnet奖励计划是一项协作竞赛，旨在对网络进行压力测试，鼓励全世界的参与者参与，并帮助矿工准备运行世界上最大的分散式存储网络。竞争的基本结构很简单：三个星期时间，矿工将竞争为网络提供尽可能多的存储容量。全球排名前100名的矿工以及每个大洲的前50名矿工将根据测试期间他们和网络实现的存储量获得Filecoin奖励。</div><div>矿工可以通过两种方式获得更多奖励：</div><div>奖励池的总大小随网络总存储容量的增加而增加。</div><div>奖励的总池按合格采矿业务按比例分配，具体取决于它们添加的存储量占总网络存储量的百分比。</div><p><img title=\"1596593753667373.png\" alt=\"微信图片_20200805101606.png\" src=\"/uploads/image/20200805/1596593753667373.png\"/></p><div><strong>3、APOLLO</strong></div><div>APOLLO将于8月19日至9月30日举行，为期6周，仅邀请对Filecoin生态系统感兴趣的企业家，建筑商和制造商，使用Filecoin和Web 3.0生态系统启动他们的新项目。</div><div>该计划很大程度上受到KERNEL成功的启发，KERNEL吸引了250多个建筑商共同建设了70个项目。最重要的是，参与该计划的同行之间建立了终身的友好合作关系。我们迫不及待地希望通过类似的APOLLO任务取得成功。</div><div>APOLLO的重点是为对Filecoin感兴趣并且有才华的同行提供一个基地。该计划本质上将是开放性的，首先要制定一个强大的课程提纲，以学习如何思考和构建开放系统。这个程序将为APOLLO建设者提供机会来学习他们的项目，并与Filecoin世界前沿的其他建设者建立终身合作关系。</div><div>APOLLO 的建设者可以在该平台上获得对初创公司的投资，希望更多人将成为新生的Filecoin生态系统的支柱。</div><p><img title=\"1596593781546916.png\" alt=\"微信图片_20200805101637.png\" src=\"/uploads/image/20200805/1596593781546916.png\"/></p><div><strong>4、SpFilecoin Launchpad</strong></div><div>该Filecoin Launchpad的加速器是为了IPFS&amp;Filecoin重建WEB网络的全时段远程的可以让初创企业进行更加开放、可互操作和可编程的工具、设施和应用程序。</div><div>创始团队的建设将考虑从Protocol Labs协议实验室，甚至以太坊项目团队中构建。</div><div>该计划将于2020年9月至2020年12月启动，有15至20个团队围绕业务和区块链特定问题提供了资金，指导，福利和编程。</div><p><br/></p><p>看来8月的Filecoin更加令人期待，对大矿工们来说是机遇与挑战并存！</p><p><br/></p>','admin','1596593546','1596593546','all','0','/Public/Uploads/news/5f2a15b55a5b0.png');/* MySQLReback Separation */
