 /* 创建表结构 `ds_order_list` */
 DROP TABLE IF EXISTS `ds_order_list`;/* MySQLReback Separation */ CREATE TABLE `ds_order_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `username` varchar(50) NOT NULL COMMENT '用户名',
  `paytype` varchar(10) NOT NULL COMMENT 'yuanqi 元气值租赁 erwei现金付款',
  `kjid` int(11) NOT NULL COMMENT '矿机ID',
  `kjname` varchar(50) NOT NULL COMMENT '矿机名称',
  `price` decimal(20,2) NOT NULL COMMENT '价格',
  `addtime` varchar(12) NOT NULL COMMENT '申请时间',
  `confirmtime` varchar(12) NOT NULL COMMENT '审核时间',
  `confirmadmin` varchar(50) NOT NULL,
  `status` tinyint(1) NOT NULL COMMENT '0未审核 1已通过 2未通过',
  `upimg` text NOT NULL COMMENT '上传的图片',
  `shensu` text NOT NULL COMMENT '申诉内容',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=282 DEFAULT CHARSET=utf8;/* MySQLReback Separation */
