  `jackpot_status2` int(11) NOT NULL COMMENT '每日节点代币分配状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8;/* MySQLReback Separation */
